o=A.b(["Vicepresidente de las Seis Federaciones del Chapare","Presidente interino de las Seis Federaciones","Senador por Cochabamba y Presidente del Senado"],q)
o=A.dc("Polit\xf3logo y dirigente cocalero del Chapare, presidente del Senado desde noviembre de 2020.","\u2981 Andr\xf3nico Rodr\xedguez Ledezma naci\xf3 el 11 de noviembre de 1988 en San Isidro, Sacaba, Cochabamba. Es hijo de un dirigente cocalero, lo que marc\xf3 desde temprano su cercan\xeda con las organizaciones sociales del Tr\xf3pico.\n\u2981 Estudi\xf3 Ciencias Pol\xedticas en la Universidad Mayor de San Sim\xf3n (UMSS), donde tambi\xe9n fue dirigente universitario.\n\u2981 Desde joven, particip\xf3 activamente en las Seis Federaciones del Tr\xf3pico de Cochabamba, destacando por su liderazgo y capacidad organizativa.\n\u2981 En 2018 fue electo vicepresidente de estas federaciones y un a\xf1o despu\xe9s asumi\xf3 como presidente, sucediendo al hist\xf3rico liderazgo de Evo Morales.\n\u2981 En 2020 fue electo senador por el MAS-IPSP, convirti\xe9ndose r\xe1pidamente en una figura central en el Senado.\n\u2981 Ese mismo a\xf1o fue designado como presidente de la C\xe1mara Alta y reelecto en a\xf1os consecutivos, liderando sesiones legislativas clave.\n\u2981 En 2022, debido a la ausencia del presidente y vicepresidente del pa\xeds, asumi\xf3 la presidencia interina de Bolivia durante algunos d\xedas.\n\u2981 En 2025, tras diferencias internas con el MAS y con Evo Morales, se postul\xf3 a la presidencia de Bolivia por la Alianza Popular, buscando una renovaci\xf3n dentro del campo progresista.\n",p,"\u2981 Rodr\xedguez ha demostrado una destacada capacidad para el liderazgo desde su juventud, primero como dirigente estudiantil y luego como representante sindical.\n\u2981 Su paso por las Seis Federaciones del Tr\xf3pico le otorg\xf3 experiencia en organizaci\xf3n, movilizaci\xf3n y manejo de conflictos sociales.\n\u2981 En el Senado, ha sabido posicionarse como un articulador de consensos, impulsando leyes importantes y conteniendo tensiones entre bancadas enfrentadas.\n\u2981 Su visi\xf3n integradora busca unir a los sectores sociales rurales con una propuesta pol\xedtica m\xe1s inclusiva, menos polarizada y con fuerte base territorial.\n",A.b(["Defensor de derechos de comunidades cocaleras","Promotor de inclusi\xf3n pol\xedtica","Ha liderado fiscalizaci\xf3n legislativa"],q),"\u2981 Rodr\xedguez ha mantenido un compromiso firme con la defensa de los productores de coca del Tr\xf3pico, siendo su voz en el \xe1mbito nacional.\n\u2981 En el Senado, promovi\xf3 leyes orientadas a fortalecer la participaci\xf3n pol\xedtica de sectores rurales, ind\xedgenas y populares.\n\u2981 Ejerci\xf3 una intensa labor de fiscalizaci\xf3n legislativa, interpelando ministros, revisando pol\xedticas p\xfablicas y proponiendo reformas judiciales y constitucionales.\n\u2981 Su discurso se ha enfocado en la renovaci\xf3n generacional dentro de la izquierda boliviana, alej\xe1ndose del caudillismo.\n",A.b(["Denunciado en 2019 por sedici\xf3n y terrorismo","Acusado de traicionar principios ideol\xf3gicos"],q),'\u2981 En el contexto de la crisis poselectoral de 2019, fue denunciado por presuntos delitos de terrorismo y sedici\xf3n tras encabezar movilizaciones de sectores afines al MAS en defensa del gobierno de Evo Morales.\n\u2981 El 21 de noviembre de 2019 dos asamble\xedstas presentaron una denuncia penal contra Rodr\xedguez por terrorismo, sedici\xf3n, amenazas y coacci\xf3n, citando como pruebas atentados al gasoducto Villa Tunari\u2011Carrasco y la quema de estaciones policiales, entre otros incidentes.\n\u2981 La Fiscal\xeda rechaz\xf3 esa denuncia en octubre de 2020 por falta de elementos concretos que individualizaran responsabilidades en los hechos atribuidos.\n\u2981 En enero de 2020 gener\xf3 controversia al anunciar que la "resistencia pac\xedfica" pro\u2011MAS terminar\xeda el 22 de enero; sus detractores calificaron el mensaje como instigaci\xf3n a la violencia, aunque \xe9l neg\xf3 haber promovido acciones violentas.\n\u2981 Las protestas de finales de 2019 incluyeron la Masacre de Sacaba (15 de noviembre): once muertos, decenas de heridos y cientos de arrestados cuando cocaleros trataban de llegar a Cochabamba; la CIDH y expertos calificaron estos hechos como masacre y violaci\xf3n grave de derechos humanos por parte del gobierno interino.\n\u2981 En diciembre de 2019 la CIDH defini\xf3 las muertes en Sacaba y Senkata como masacres y en 2020 y 2021 organismos como la Cl\xednica Internacional de Derechos Humanos de Harvard y la Defensor\xeda del Pueblo de Bolivia concluyeron que hubo delitos de lesa humanidad.\n\u2981 En 2025, tras su ruptura con el MAS, fue acusado por sectores oficialistas de ser un "traidor" y de dividir a la izquierda boliviana; tanto en redes como en actos p\xfablicos se le reproch\xf3 el cambio de alianza electoral.\n\u2981 Su candidatura por Alianza Popular fue interpretada por algunos como un acto de transfuguismo pol\xedtico, lo cual dio lugar a recursos ante el Tribunal Supremo Electoral para intentar recuperar su curul en el Senado.\n',"Entrevista As\xed Decidimos (Unitel):\n\u2981 Cuestionan su ruptura con Evo Morales; responde sin cr\xedticas directas, dejando dudas sobre su autonom\xeda.\n\u2981 Se le pregunta por qu\xe9 no renunci\xf3 a su curul del MAS antes de postularse por Alianza Popular; su respuesta resulta ambigua.\n\u2981 Niega sospechas de v\xednculos con narcotr\xe1fico, aunque su cercan\xeda al sector cocalero genera cuestionamientos.\n\u2981 Aclara que su actuaci\xf3n en el Senado fue neutral, pero no presenta ejemplos contundentes que respalden esa afirmaci\xf3n.\n\nEntrevista Punto Vida:\n\u2981 Su r\xe1pido ascenso en el MAS es atribuido a m\xe9ritos propios; sin embargo, no detalla los procesos internos que lo respaldaron.\n\u2981 Defiende la unidad del movimiento cocalero, pero evita mencionar tensiones o divisiones internas recientes.\n\u2981 No realiza autocr\xedtica sobre su papel en decisiones legislativas del MAS; el di\xe1logo queda en t\xe9rminos vagos.\n\nDebate extendido As\xed Decidimos:\n\u2981 Rechaza financiamiento externo sin mencionar cifras o mecanismos concretos de control financiero.\n\u2981 Justifica su rol en movilizaciones de 2019 como defensa de la democracia; no condena expl\xedcitamente los hechos violentos.\n\u2981 Evade cr\xedticas por falta de experiencia ejecutiva, alegando que su liderazgo org\xe1nico lo prepara para el cargo.\n\nEntrevista La Caja Negra (Uno Decide):\n\u2981 Reconoce la influencia hist\xf3rica de Evo Morales, pero no profundiza en cr\xedticas concretas al MAS o experiencias de corrupci\xf3n.\n\u2981 Menciona presiones internas para evitar su postulaci\xf3n, pero sin aportar evidencia ni nombres espec\xedficos.\n\u2981 Presenta su proyecto como renovador y colectivo, aunque su discurso comparte muchos s\xedmbolos y ret\xf3rica del MAS.\n\n",7,1,1,u.m,9,"Andr\xf3nico Rodr\xedguez Ledezma",7,5,8,o,"\u2981 Inici\xf3 como dirigente en la universidad, donde desarroll\xf3 habilidades pol\xedticas y de discurso.\n\u2981 Su ascenso en las Seis Federaciones fue r\xe1pido debido a su carisma y disciplina.\n\u2981 Durante su presidencia sindical, mantuvo la unidad del movimiento cocalero en tiempos de crisis pol\xedtica.\n\u2981 En 2020 fue electo senador por el departamento de Cochabamba.\n\u2981 Ya en su primer a\xf1o fue nombrado presidente del Senado, cargo que ocup\xf3 en m\xfaltiples gestiones.\n\u2981 Ha representado a Bolivia en foros internacionales como vocero del poder legislativo.\n\u2981 En 2022, asumi\xf3 brevemente la presidencia del pa\xeds ante la ausencia de los altos mandos ejecutivos.\n")
p=A.b(["Excelente formaci\xf3n t\xe9cnica en planificaci\xf3n p\xfablica","Experiencia en cooperaci\xf3n internacional","Dominio de ingl\xe9s, franc\xe9s y conocimientos de aymara"],q)
n=A.b(["Consultora en Ministerio de Trabajo y Obras P\xfablicas","Presidente del Directorio de BoA","Ministra de Planificaci\xf3n del Desarrollo","Vicepresidenta Ejecutiva de FONPLATA"],q)
n=A.dc("Administradora de empresas y ex Ministra de Planificaci\xf3n (2017\u20112019), actual Vicepresidenta Ejecutiva de FONPLATA desde 2023.","\u2981 Administradora de empresas, abogada y servidora p\xfablica boliviana. Naci\xf3 en La Paz y estudi\xf3 Administraci\xf3n en la Universidad Cat\xf3lica Boliviana, y m\xe1s adelante Derecho.\n\u2981 Fue Ministra de Planificaci\xf3n del Desarrollo durante el gobierno de Evo Morales (2017\u20132019), desde donde impuls\xf3 programas de inversi\xf3n p\xfablica con enfoque participativo.\n\u2981 Antes, trabaj\xf3 como consultora en el Ministerio de Trabajo y Obras P\xfablicas, presidi\xf3 el directorio de BoA (Boliviana de Aviaci\xf3n) entre 2010 y 2012, y fue jefa de gabinete en la Vicepresidencia del Estado entre 2012 y 2014.\n\u2981 En 2023 asumi\xf3 como Vicepresidenta Ejecutiva de FONPLATA, banco de desarrollo regional con sede en Santa Cruz, Bolivia, desde donde articula programas de financiamiento binacional orientados a infraestructura, desarrollo sostenible y conectividad regional.\n",p,"\u2981 Conocimiento en planificaci\xf3n estrat\xe9gica, dise\xf1o de pol\xedticas p\xfablicas y ejecuci\xf3n de programas de inversi\xf3n social. Posee amplia experiencia en coordinaci\xf3n interinstitucional y cooperaci\xf3n multilateral.\n\u2981 Su dominio de idiomas y experiencia internacional le permiten actuar como enlace t\xe9cnico-diplom\xe1tico ante organismos como CAF, BID y FONPLATA.\n\u2981 Se destaca por su capacidad de gesti\xf3n, su formaci\xf3n multidisciplinaria, y su enfoque en resultados sociales con equidad territorial.\n",A.b(["Implement\xf3 pol\xedticas de desarrollo con enfoque participativo","Fortaleci\xf3 relaciones institucionales","Impuls\xf3 proyectos de infraestructura"],q),"\u2981 Durante su gesti\xf3n en el Ministerio de Planificaci\xf3n, coordin\xf3 importantes planes de desarrollo urbano y rural, priorizando el acceso equitativo a servicios b\xe1sicos.\n\u2981 Promovi\xf3 alianzas p\xfablico\u2011privadas y fortaleci\xf3 v\xednculos con agencias multilaterales de cooperaci\xf3n.\n\u2981 En FONPLATA, ha impulsado la ejecuci\xf3n de proyectos regionales en sectores como transporte, agua potable y saneamiento, salud e inclusi\xf3n social, beneficiando especialmente a comunidades vulnerables.\n",A.b(["Controversia en 2017 por su breve trabajo con USAID","Cuestionada por declaraci\xf3n en caso de feminicidio"],q),"\u2981 En 2017 surgi\xf3 controversia cuando se conoci\xf3 que trabaj\xf3 brevemente para la agencia estadounidense USAID, criticada en Bolivia por presunta injerencia pol\xedtica.\n\u2981 Adem\xe1s, fue fuertemente cuestionada por testificar a favor de William Kushner, acusado y luego condenado por feminicidio, lo que gener\xf3 rechazo en colectivos feministas.\n\u2981 Aunque ha sostenido que su testimonio fue en el marco del debido proceso, este hecho afect\xf3 temporalmente su imagen p\xfablica.\n","Entrevista en Red Uno (\u201cDecidamos juntos\u201d, julio\u202f2025):\n\u2981 Revel\xf3 que acept\xf3 ser candidata a la Vicepresidencia solo si no se atacaba p\xfablicamente a Evo Morales, generando cr\xedticas sobre falta de autonom\xeda pol\xedtica.\n\u2981 Aclar\xf3 que descart\xf3 alianzas con siglas tradicionales como ADN, circunscribiendo su candidatura al marco del MAS fragmentado, lo que dividi\xf3 opiniones dentro de su propio frente.\n\nDebate Vicepresidencial Unitel (junio\u202f2025):\n\u2981 Defendi\xf3 que la gobernabilidad se construye \u201cen las calles\u201d y no solo en la Asamblea, lo que fue interpretado por opositores como falta de compromiso con el orden institucional.\n\u2981 Promocion\xf3 a Andr\xf3nico Rodr\xedguez como arquitecto de los acuerdos sociales, lo que fue visto como una entrega anticipada del protagonismo.\n\nLanzamiento de candidatura, ANF (mayo\u202f2025):\n\u2981 Fue abucheada por seguidores de Andr\xf3nico Rodr\xedguez por ser considerada un \u201calfil de Garc\xeda Linera\u201d.\n\u2981 Critic\xf3 la propuesta de la oposici\xf3n de desechar por completo el modelo MAS, generando rechazo por defender s\xedmbolos del pasado pol\xedtico.\n\nControversia USAID (enero\u202f2017):\n\u2981 Se revel\xf3 que trabaj\xf3 cuatro meses para USAID, agencia acusada por el gobierno de Morales de injerencia pol\xedtica; este dato no figuraba p\xfablicamente en su hoja de vida oficial.\n\u2981 El Ministerio emiti\xf3 un comunicado aclarando que fue una consultor\xeda breve, pero la omisi\xf3n inicial gener\xf3 sospechas sobre transparencia.\n\nTestimonio a favor de William Kushner (junio\u202f2018):\n\u2981 Testific\xf3 ante el Tribunal S\xe9ptimo de Sentencia creyendo en la inocencia de William Kushner, condenado por feminicidio, lo que provoc\xf3 rechazo masivo de colectivos feministas.\n\u2981 La madre de la v\xedctima present\xf3 pruebas y pidi\xf3 p\xfablicamente que se impidiera su participaci\xf3n en la carrera electoral, alegando falta de sensibilidad y \xe9tica.\n",8,2,1,u.d,6,"Mariana Prado Noya",5,6,7,n,"\u2981 Trabaj\xf3 como consultora t\xe9cnica en el Ministerio de Trabajo (2007\u20112008), y posteriormente en Obras P\xfablicas, donde elabor\xf3 propuestas de fortalecimiento institucional.\n\u2981 Fue presidenta del Directorio de Boliviana de Aviaci\xf3n (2010\u20112012), impulsando mejoras operativas y ampliaci\xf3n de rutas nacionales.\n\u2981 De 2012 a 2014 se desempe\xf1\xf3 como jefa de gabinete de la Vicepresidencia del Estado, participando en la articulaci\xf3n de planes sectoriales.\n\u2981 En 2017 fue designada ministra de Planificaci\xf3n del Desarrollo, desde donde dirigi\xf3 el Sistema de Planificaci\xf3n Integral del Estado (SPIE).\n\u2981 Desde 2023 ocupa el cargo de Vicepresidenta Ejecutiva de FONPLATA, liderando proyectos de integraci\xf3n regional y financiamiento estrat\xe9gico para obras de infraestructura.\n")
