m=A.dc("Empresario potosino vinculado al sector agroindustrial. Fundador de NGP.",'\u2022 Fidel Tapia Zambrana es un empresario boliviano oriundo del departamento de Potos\xed, aunque ha desarrollado gran parte de su actividad en Cochabamba. Est\xe1 vinculado al sector agroindustrial, especialmente en la producci\xf3n agr\xedcola, comercializaci\xf3n de alimentos y servicios log\xedsticos asociados al agro. \u2022 En 2024 fund\xf3, junto con el tambi\xe9n empresario Edgar Uriona, el partido pol\xedtico Nueva Generaci\xf3n Patri\xf3tica (NGP), con la intenci\xf3n de abrir un espacio nuevo para liderazgos empresariales y regionales en la pol\xedtica nacional. \u2022 Fue inicialmente registrado como "candidato provisional" a la presidencia en la f\xf3rmula del NGP, para cumplir los requisitos administrativos de inscripci\xf3n ante el Tribunal Supremo Electoral, aunque luego renunci\xf3 para ceder paso a un binomio definitivo.',p,"\u2022 Cuenta con experiencia directa en actividades agr\xedcolas y log\xedsticas, y ha trabajado estrechamente con productores rurales, cooperativas y distribuidores del sector agropecuario. \u2022 Posee capacidad de organizaci\xf3n, articulaci\xf3n con actores regionales y visi\xf3n de desarrollo econ\xf3mico desde una perspectiva productiva. \u2022 Su participaci\xf3n en la creaci\xf3n del partido NGP demuestra iniciativa pol\xedtica y capacidad de proyecci\xf3n en entornos sociales no tradicionales.",A.b(["Fomento a la producci\xf3n agr\xedcola regional","Apost\xf3 por un nuevo proyecto pol\xedtico"],q),"\u2022 Ha promovido el desarrollo de peque\xf1as y medianas iniciativas agr\xedcolas, apostando por el fortalecimiento de econom\xedas locales. \u2022 Su incursi\xf3n en pol\xedtica busca romper con estructuras partidarias tradicionales, promoviendo una visi\xf3n de pa\xeds desde el emprendedurismo y la econom\xeda regional. \u2022 Su liderazgo es visto como una representaci\xf3n aut\xe9ntica de sectores productivos que usualmente no participan en pol\xedtica.",A.b(["Renunci\xf3 a su candidatura presidencial","Poca experiencia en cargos p\xfablicos"],q),'\u2022 Fue calificado por la prensa como "candidato fantasma" por figurar inicialmente solo para cumplir formalidades del registro electoral, lo que gener\xf3 cr\xedticas sobre la transparencia de la estrategia pol\xedtica del NGP. \u2022 Su falta de experiencia en funciones de gesti\xf3n p\xfablica ha sido se\xf1alada como una debilidad, generando dudas sobre su preparaci\xf3n para ejercer cargos de alta responsabilidad estatal.','Contexto NGP y candidatura provisional:\n\u2981 Fue inscrito como "candidato provisional" por NGP ante el TSE, con el prop\xf3sito de cubrir temporalmente la candidatura de Jaime Dunn debido a problemas de solvencia fiscal.\n\u2981 La organizaci\xf3n pol\xedtica NGP ratific\xf3 a Dunn como candidato presidencial leg\xedtimo y calific\xf3 la situaci\xf3n como una \u201cguerra sucia\u201d para desprestigiarlo.\n\nRenuncia y sustituci\xf3n:\n\u2981 El 25 de junio de 2025, Fidel Tapia Zambrana present\xf3 oficialmente su renuncia como candidato presidencial por NGP, documento confirmado por el TSE y difundido por medios como Br\xfajula Digital y Unitel.\n\u2981 En su reemplazo, Jaime Dunn asumi\xf3 la candidatura, una decisi\xf3n vinculada a la obtenci\xf3n de su certificado de solvencia fiscal ante la Contralor\xeda.\n\n',3,3,2,"https://otorongo.club/candidate/41319318",4,"Fidel Tapia Zambrana",2,4,3,m,"\u2022 Fund\xf3 en 2024 el partido Nueva Generaci\xf3n Patri\xf3tica junto a Edgar Uriona, con el objetivo de representar intereses regionales y productivos en el escenario pol\xedtico nacional. \u2022 Ha desarrollado su carrera empresarial en rubros como la agricultura, distribuci\xf3n de alimentos y apoyo a la cadena agroindustrial. \u2022 Particip\xf3 activamente en movimientos c\xedvicos y empresariales en Potos\xed, promoviendo propuestas de desarrollo con base regional, aunque sin ocupar cargos p\xfablicos anteriormente.")
