l=A.dc("Empresario agropecuario con enfoque regional. Fue vicepresidente del binomio original de NGP.","\u2022 Edgar Uriona Veizaga es un empresario boliviano oriundo de Cochabamba, vinculado al sector agropecuario y al desarrollo productivo rural. Es cofundador del partido Nueva Generaci\xf3n Patri\xf3tica (NGP), agrupaci\xf3n pol\xedtica registrada oficialmente en 2024 con el objetivo de representar los intereses de productores regionales, j\xf3venes emprendedores y ciudadanos ajenos a la pol\xedtica tradicional.\n\u2022 En las elecciones generales de 2025, fue designado como candidato a la vicepresidencia de Bolivia por esta organizaci\xf3n, integrando el binomio inicial del NGP.\n\u2022 Su discurso gira en torno a la transparencia, la honestidad y la necesidad de devolver el poder pol\xedtico al pueblo boliviano a trav\xe9s de nuevas pr\xe1cticas democr\xe1ticas m\xe1s cercanas a las bases.\n",p,"\u2022 Es reconocido como empresario cochabambino exitoso con trayectoria internacional; emigr\xf3 a EE.\u202fUU., inici\xf3 como alba\xf1il, fund\xf3 varias empresas y lidera un consorcio enfocado en bienes ra\xedces y construcci\xf3n.\n\u2022 Fue elegido precandidato de Nueva Generaci\xf3n Patri\xf3tica (NGP) por unanimidad en febrero de 2025, destacando por su liderazgo y credibilidad ante los comit\xe9s departamentales.\n\u2022 Presenta un perfil de outsider pol\xedtico con capacidad de articular un discurso de \u201ctransparencia radical\u201d, apego a la \xe9tica p\xfablica y rechazo a la tradicional clase pol\xedtica.\n\u2022 Propuso medidas audaces como la cadena perpetua para corruptos, mostrando determinaci\xf3n, enfoque en resultados y compromiso con el fortalecimiento institucional.\n\u2022 Promueve innovaciones tecnol\xf3gicas como el uso de blockchain para transparencia en contrataciones y eliminaci\xf3n del secreto bancario para funcionarios p\xfablicos, lo que refleja una visi\xf3n moderna de gesti\xf3n p\xfablica.\n\u2022 Se le describe como un l\xedder conciliador y comunicador asertivo, capaz de inspirar confianza y movilizar apoyo ciudadano, seg\xfan declaraciones de Jaime Dunn y observaciones en medios.\n",A.b(["Apoyo a productores rurales","Representaci\xf3n de intereses regionales"],q),"\u2022 Ha sido portavoz de demandas regionales como el acceso al cr\xe9dito rural, el fortalecimiento del riego y la infraestructura productiva.\n\u2022 Defiende una propuesta de Estado descentralizado y participativo, buscando que las decisiones se construyan desde las regiones.\n\u2022 Se ha posicionado como una figura ajena a los c\xedrculos pol\xedticos tradicionales, lo que le ha valido simpat\xeda entre j\xf3venes emprendedores y ciudadanos cr\xedticos del sistema.\n",A.b(["Baja proyecci\xf3n nacional","Ausencia de experiencia pol\xedtica comprobada"],q),"\u2022 Es considerado por algunos analistas como un candidato con visibilidad limitada fuera del eje central del pa\xeds.\n\u2022 Su falta de trayectoria en gesti\xf3n p\xfablica y pol\xedtica institucional ha generado dudas respecto a su capacidad para asumir responsabilidades de gobierno.\n\u2022 Adem\xe1s, ha sido criticado por sostener discursos generales sobre honestidad sin presentar propuestas concretas en temas clave como salud, educaci\xf3n o justicia.\n","Entrevista Palenque TV\u2022 Se le cuestion\xf3 por su falta de recorrido en cargos p\xfablicos; defiende su perfil empresarial, pero no detall\xf3 c\xf3mo eso se traduce en capacidad de gobierno.\n\u2022 Al hablar de \u201ctransparencia radical\u201d, evit\xf3 responder preguntas sobre qui\xe9n financiar\xeda su campa\xf1a, generando dudas sobre el financiamiento.\n\u2022 Frente a cr\xedticas sobre alianzas con Evo Morales, afirm\xf3 que no se alinea con ninguna figura pol\xedtica, aunque no identific\xf3 respaldos concretos.\n\nPrograma Posdata\u2022 Promovi\xf3 blockchain y eliminaci\xf3n del secreto bancario como medidas innovadoras, pero no dio detalles sobre su viabilidad legal o t\xe9cnica.\n\u2022 Cuando se le consult\xf3 por c\xf3mo responsabilizar a funcionarios corruptos, propuso \u201ccastigo ejemplar\u201d sin explicar procesos institucionales.\n\u2022 Su defensa de la participaci\xf3n ciudadana como base de gobierno fue interpretada por opositores como ausencia de enfoque institucional.\n\nEl Bunker\u2022 Se presenta como un empresario exitoso que volvi\xf3 al pa\xeds, pero no se mencionan pruebas concretas de logros agr\xedcolas o productivos.\n\u2022 Habla de su compromiso con actores regionales, aunque no se citan miembros de comunidades o declaraciones externas que corroboren esa cercan\xeda.\n\u2022 La narrativa evita el debate sobre sus alianzas o v\xednculos pol\xedticos; presenta un perfil \u201cciudadano com\xfan\u201d, lo que algunos interpretaron como falta de transparencia.\n\n",4,4,2,"assets/postulantes/NGP_edgar_Uriona.png",5,"Edgar Uriona Veizaga",3,5,4,l,"\u2022 En 2024 particip\xf3 en la fundaci\xf3n del partido Nueva Generaci\xf3n Patri\xf3tica junto a Fidel Tapia Zambrana, con el prop\xf3sito de crear un proyecto pol\xedtico alejado del caudillismo y con \xe9nfasis en el desarrollo econ\xf3mico desde las regiones.\n\u2022 Fue oficialmente inscrito como candidato a la vicepresidencia en las elecciones generales de 2025.\n\u2022 Ha liderado distintos proyectos productivos privados en el rubro agr\xedcola, impulsando asociaciones y redes de comercializaci\xf3n con enfoque local.\n")
