k=A.dc("Pol\xedtico cruce\xf1o y empresario. Actual alcalde de Santa Cruz de la Sierra.","\u2022 Max Jhonny Fern\xe1ndez Saucedo es un pol\xedtico y empresario nacido en Santa Cruz de la Sierra. Es hijo de Max Fern\xe1ndez Rojas, fundador de la agrupaci\xf3n pol\xedtica Unidad C\xedvica Solidaridad (UCS).\u2022 Max Jhonny inici\xf3 su carrera como concejal municipal en los a\xf1os 90, y luego asumi\xf3 la alcald\xeda de Santa Cruz de la Sierra en dos periodos: primero de 2000 a 2005, y luego desde 2021 hasta la actualidad.\u2022 Ha estado fuertemente vinculado al partido UCS, el cual ha liderado desde la muerte de su padre. Su gesti\xf3n se ha caracterizado por la promoci\xf3n de obras de infraestructura urbana, pol\xedticas de conectividad vial y fortalecimiento del empleo local.\u2022 Adem\xe1s, ha sido una figura constante en la pol\xedtica municipal cruce\xf1a por m\xe1s de dos d\xe9cadas, alternando entre roles de liderazgo partidario y de administraci\xf3n p\xfablica.",p,"\u2022 Posee una amplia trayectoria en la administraci\xf3n p\xfablica municipal, con experiencia ejecutiva s\xf3lida en planificaci\xf3n, ejecuci\xf3n presupuestaria y desarrollo urbano.\u2022 Tiene una capacidad para movilizar votantes en zonas periurbanas y barrios populosos.\u2022 Ha sabido construir una imagen de continuidad del legado pol\xedtico de su padre, combinando discurso t\xe9cnico con cercan\xeda al ciudadano.",A.b(["Impulso de proyectos de infraestructura urbana","Conectividad con barrios perif\xe9ricos"],q),"\u2022 Bajo su gesti\xf3n se han construido puentes, avenidas y sistemas de drenaje en zonas perif\xe9ricas de Santa Cruz.\u2022 Ha facilitado la expansi\xf3n urbana ordenada y gestionado recursos para mejorar la movilidad urbana.\u2022 Tambi\xe9n ha priorizado el mantenimiento de \xe1reas verdes, iluminaci\xf3n p\xfablica y proyectos de revalorizaci\xf3n de espacios vecinales.",A.b(["Cr\xedticas por nepotismo y contratos adjudicados a allegados","Acusaciones por v\xednculos con redes de loteamiento irregular"],q),"\u2022 Su administraci\xf3n ha sido se\xf1alada por supuestos actos de nepotismo y favoritismo en licitaciones municipales.\u2022 En 2023 enfrent\xf3 intentos de revocatoria ciudadana impulsados por sectores que lo acusaban de presunta vinculaci\xf3n con redes de loteamiento ilegal.\u2022 Aunque muchas de estas acusaciones no han prosperado judicialmente, han generado cuestionamientos p\xfablicos sobre la transparencia de su gesti\xf3n.","\u201cPiedra, Papel y Tinta\u201d \u2013 La Raz\xf3n (10 de octubre de 2023) \n\u2022 Evit\xf3 confirmar su candidatura presidencial, generando dudas sobre sus verdaderas intenciones pol\xedticas.\n\u2022 Su propuesta de di\xe1logo y reformas fue criticada por sectores que la consideraron vaga y sin concreci\xf3n.\n\u2022 Algunos medios cuestionaron su falta de claridad sobre c\xf3mo abordar la polarizaci\xf3n pol\xedtica en Bolivia.\n\n\u201cQue No Me Pierda\u201d \u2013 Red Uno (5 de junio de 2025)\u2022 Fern\xe1ndez expres\xf3 que las condiciones sociales no son \xf3ptimas para llevar adelante elecciones, postura que fue interpretada por sectores opositores como un intento de dilatar el proceso electoral y favorecer a ciertos grupos.\n\u2022 Neg\xf3 tener v\xednculos con Evo Morales o el MAS, pero declaraciones contradictorias previas levantaron suspicacias y cr\xedticas acerca de su independencia pol\xedtica real.\n\u2022 Fue cuestionado por no ofrecer soluciones claras frente a problemas estructurales como la inseguridad, la corrupci\xf3n y la pobreza, lo que afect\xf3 su imagen como candidato viable.\n Debate presidencial \u201cUno Decide\u201d \u2013 Red Uno (julio 2025)\n\u2022 Propuso un \u201cperdonazo\u201d tributario y una reducci\xf3n del 30\u202f% de la burocracia estatal, lo que caus\xf3 pol\xe9mica entre economistas y pol\xedticos.\n\u2022 Acus\xf3 a otros candidatos de corrupci\xf3n y v\xednculos con Evo Morales, generando tensiones y controversias p\xfablicas.\n\u2022 Fue criticado por falta de propuestas concretas para temas clave como salud, educaci\xf3n y seguridad.\n\u2022 Desafi\xf3 a autoridades a aplicar medidas inmediatas por decreto, lo que algunos interpretaron como populismo.\n",9,5,3,u.J,8,"Max Jhonny Fern\xe1ndez Saucedo",7,7,6,k,"\u2022 Fue concejal municipal en la d\xe9cada de los 90 y asumi\xf3 la alcald\xeda cruce\xf1a en el a\xf1o 2000. Durante su primera gesti\xf3n, lider\xf3 importantes transformaciones en infraestructura vial.\u2022 Tras a\xf1os de actividad privada y liderazgo partidario, volvi\xf3 a postularse y fue electo nuevamente como alcalde en 2021.\u2022 Desde UCS ha promovido una l\xednea pol\xedtica de descentralizaci\xf3n, defensa de la autonom\xeda departamental y fortalecimiento de gobiernos municipales.")
