h=A.dc("Candidato a la vicepresidencia por la alianza LYP-ADN. Persona con escasa proyecci\xf3n medi\xe1tica nacional.","\u2022 Antonio Saravia es un acad\xe9mico y analista boliviano especializado en econom\xeda pol\xedtica con enfoque liberal. Es conocido por su participaci\xf3n en medios escritos a trav\xe9s de columnas de opini\xf3n en peri\xf3dicos como P\xe1gina Siete, El Deber y Los Tiempos.\u2022 Tiene formaci\xf3n universitaria avanzada en econom\xeda y filosof\xeda pol\xedtica, con estudios realizados en el extranjero. Se ha desempe\xf1ado como docente universitario y conferencista en temas relacionados con libertad econ\xf3mica, reducci\xf3n del tama\xf1o del Estado, y cr\xedtica a pol\xedticas populistas.\u2022 Fue presentado como candidato a la vicepresidencia para las elecciones generales de 2025 por la alianza entre Libertad y Progreso (LYP) y Acci\xf3n Democr\xe1tica Nacionalista (ADN), formando parte de una f\xf3rmula que busca representar una opci\xf3n liberal y promercado.",p,"\u2022 Posee capacidad argumentativa destacada, respaldada por una s\xf3lida formaci\xf3n acad\xe9mica en ciencias econ\xf3micas y pensamiento pol\xedtico liberal. Ha ejercido como docente universitario en Estados Unidos y ha publicado m\xfaltiples art\xedculos de opini\xf3n y an\xe1lisis econ\xf3mico en medios bolivianos e internacionales, lo que refuerza su credibilidad intelectual.\n\u2022 Ha impulsado el debate p\xfablico sobre pol\xedticas econ\xf3micas de libre mercado, institucionalismo y reducci\xf3n del intervencionismo estatal. Sus propuestas incluyen la privatizaci\xf3n de empresas p\xfablicas deficitarias, la apertura del comercio internacional, la eliminaci\xf3n de subsidios distorsivos y una reforma profunda del aparato estatal. Aboga por una nueva Constituci\xf3n que sustituya al Estado Plurinacional por un Estado unitario liberal, basado en la defensa de la propiedad privada y las libertades individuales.\n\u2022 Si bien carece de experiencia pol\xedtica tradicional, su participaci\xf3n en espacios acad\xe9micos, medios de comunicaci\xf3n y organizaciones c\xedvicas lo posiciona como un intelectual p\xfablico emergente. Actualmente es presidente del Comit\xe9 Pol\xedtico del Partido Liberal de Bolivia, desde donde articula una propuesta electoral basada en ideas liberales y en una cr\xedtica estructural al estatismo que ha dominado la pol\xedtica boliviana durante d\xe9cadas.\n\n",A.b(["Figura nueva que representa una alternativa no tradicional"],q),"\u2022 Representa una ruptura con la pol\xedtica tradicional boliviana, presentando una visi\xf3n tecnocr\xe1tica basada en principios del liberalismo cl\xe1sico. Desde su trayectoria acad\xe9mica internacional, defiende una propuesta ideol\xf3gica de profundo calado liberal, sustentada en la defensa del individuo sobre el colectivo y la econom\xeda de mercado libre.\n\u2022 Ha promovido una reforma del Estado orientada a la eficiencia institucional, defensa del Estado de derecho y respeto irrestricto a las libertades individuales. Sus propuestas incluyen reducir dr\xe1sticamente el tama\xf1o del Estado, eliminar empresas p\xfablicas ineficientes, descargar la burocracia estatal y establecer seguridad jur\xeddica como base del desarrollo, como explica en art\xedculos como \u201cSiete reformas liberales de urgencia\u201d :contentReference[oaicite:1]{index=1}.\n\u2022 Su presencia en la contienda electoral a\xf1ade diversidad ideol\xf3gica al debate nacional. En la alianza Libertad y Progreso\u202f\u2011\u202fADN fue postulado como candidato a la vicepresidencia en 2025, aportando un discurso liberal cl\xe1sico y tecnocr\xe1tico. Sin embargo, renunci\xf3 a la candidatura por discrepancias con el candidato presidencial, denunciando que no se compart\xedan los principios liberales como gu\xeda pol\xedtica :contentReference[oaicite:2]{index=2},\n",A.b(["Sin experiencia comprobada en gesti\xf3n p\xfablica","Baja visibilidad y ausencia de propuestas claras"],q),"\u2022 Su falta de experiencia en administraci\xf3n p\xfablica ha generado dudas sobre su viabilidad como figura ejecutiva.\n\u2022 Adem\xe1s, su propuesta ha sido criticada por sectores populares al considerar que su visi\xf3n liberal radical est\xe1 alejada de las condiciones estructurales del pa\xeds.\n\u2022 Tambi\xe9n se ha se\xf1alado una escasa presencia territorial y proyecci\xf3n nacional, lo que podr\xeda limitar su alcance electoral.\n","TVU UMSA\u2022 Propuso eliminar o privatizar empresas p\xfablicas sin distinci\xf3n, lo que gener\xf3 preocupaci\xf3n sobre el impacto social y laboral de tales medidas.\n\u2022 Defendi\xf3 la dr\xe1stica reducci\xf3n del Estado, sugiriendo achicar su tama\xf1o hasta el m\xednimo posible, incluso a costa de servicios p\xfablicos esenciales.\n\u2022 Su postura liberal tecnocr\xe1tica fue cuestionada por sectores que consideran que ignora las condiciones estructurales del pa\xeds y su historia de participaci\xf3n estatal.\n\nLa Trinchera\u2022 Afirm\xf3 que el Presupuesto General del Estado deber\xeda bajar del 80\u202f% al 30\u202f% del PIB, lo cual implicar\xeda recortes masivos en gasto social y estatal.\n\u2022 Propuso cerrar todas las empresas p\xfablicas no rentables, lo que gener\xf3 cr\xedticas por su aparente desd\xe9n hacia sectores vulnerables que dependen de esos servicios.\n\u2022 Declar\xf3 que el Estado debe dejar de intervenir en la econom\xeda completamente, una visi\xf3n que fue tildada de irreal y peligrosa por diversos analistas.\n\nPrograma Primera Impresion\u2022 Calific\xf3 el modelo social comunitario impulsado por el MAS como un \u201cembuste\u201d, lo que provoc\xf3 rechazo inmediato por parte de sectores sociales e ind\xedgenas.\n\u2022 Cuestion\xf3 la existencia del Estado Plurinacional, sugiriendo una vuelta a un modelo republicano liberal que excluya el enfoque plurinacional.\n\u2022 Afirm\xf3 que la visi\xf3n comunitaria es un obst\xe1culo para el desarrollo econ\xf3mico, lo que gener\xf3 pol\xe9mica al desacreditar valores culturales e hist\xf3ricos del pa\xeds.\n",4,8,4,u.z,5,"Antonio V\xedctor Isaac Saravia Tapia",4,8,3,h,"\u2022 Su trayectoria profesional se ha desarrollado principalmente en el \xe1mbito universitario como profesor titular en \xe1reas de econom\xeda y an\xe1lisis pol\xedtico, lo que evidencia una s\xf3lida formaci\xf3n acad\xe9mica y capacidad docente especializada.\n\u2022 Ha publicado art\xedculos de opini\xf3n y an\xe1lisis econ\xf3mico con enfoque liberal en medios de comunicaci\xf3n tanto nacionales como internacionales, consolidando as\xed una presencia como referente intelectual en debates econ\xf3micos contempor\xe1neos.\n\u2022 En 2025 fue elegido como acompa\xf1ante de f\xf3rmula presidencial en la alianza LYP-ADN, apostando por un discurso alternativo y tecnocr\xe1tico que combina propuestas liberales con un enfoque pragm\xe1tico y profesional en la gesti\xf3n p\xfablica.\n\n")
