g=A.dc("Pol\xedtico boliviano, exalcalde de Tarija y actual senador. Hijo del expresidente Jaime Paz Zamora.","Rodrigo Paz Pereira (n. 22 de septiembre de 1967 en Santiago de Compostela, Espa\xf1a) es hijo del expresidente Jaime Paz Zamora. Se form\xf3 en colegios jesuitas y obtuvo t\xedtulos en Econom\xeda y Relaciones Internacionales, adem\xe1s de una maestr\xeda en Gesti\xf3n Pol\xedtica en American University, EE.UU. ",p,"\u2022 Naci\xf3 el 22 de septiembre de 1967 en Santiago de Compostela, Espa\xf1a, durante el exilio de su familia por la dictadura, lo que marca una trayectoria personal vinculada a la defensa democr\xe1tica.\n\u2022 Es hijo del expresidente Jaime Paz Zamora; estudi\xf3 Econom\xeda y Relaciones Internacionales, y obtuvo una maestr\xeda en Gesti\xf3n Pol\xedtica en la American University de Washington, D.C., lo cual refuerza su perfil acad\xe9mico y pol\xedtico.\n\u2022 Fue diputado nacional por el MIR (2002\u20112006) y luego por PODEMOS (2006\u20112010), presidente del Concejo Municipal de Tarija (2010\u20112015) y alcalde de Tarija (2015\u20112020), donde impuls\xf3 obras como el controvertido \u201cPuente Millonario\u201d.\n\u2022 Desde 2020 es senador por Tarija en la Asamblea Legislativa Plurinacional bajo la alianza Comunidad Ciudadana, y es l\xedder de la agrupaci\xf3n \u201cPrimero la Gente\u201d, consolidando su presencia pol\xedtica en la centroizquierda progresista.\n\u2022 En 2025 fue proclamado candidato presidencial por el Partido Dem\xf3crata Cristiano (PDC), presentando a Sebasti\xe1n Careaga como su compa\xf1ero de f\xf3rmula; su campa\xf1a se ha enfocado en institucionalidad democr\xe1tica, descentralizaci\xf3n y valores cristiano\u2011democr\xe1ticos.\n\u2022 Ha expresado fuerte solidaridad con ciudadanos perseguidos judicialmente bajo el gobierno del MAS, denunciando m\xe1s de 20 procesos en su contra y exigiendo respeto de sus derechos humanos y constitucionales.\n",A.b(["Impuls\xf3 una Tarija m\xe1s inclusiva y participativa","Modernizaci\xf3n de gesti\xf3n p\xfablica municipal","Promotor del consenso democr\xe1tico en el Senado"],q),"\u2022 Impuls\xf3 el programa \u201cAgua para todos\u201d dirigido a mejorar el acceso al agua potable en \xe1reas urbanas y rurales de Tarija durante su gesti\xf3n como alcalde.\n\u2022 Foment\xf3 iniciativas en salud y educaci\xf3n mediante inversi\xf3n en centros de atenci\xf3n primaria, aunque ciertos proyectos quedaron inconclusos durante la pandemia, como el Centro de Salud Ambulatorio 3 de Mayo.\n\u2022 Promovi\xf3 la cultura ciudadana participando activamente en eventos como el reality de periodismo \u201cPrimera Plana\u201d en Tarija, facilitando transporte y presentaciones art\xedsticas con el apoyo municipal.\n\u2022 Impuls\xf3 el turismo y desarrollo cultural local al priorizar espacios p\xfablicos y culturales urbanos, como parques y pasajes hist\xf3ricos, con enfoque en revitalizaci\xf3n comunitaria.\n\u2022 Durante su mandato se inaugur\xf3 el nuevo Mercado Central de Tarija (2018), con infraestructura moderna y alrededor de 410 puestos comerciales que dinamizaron la econom\xeda local.\n\u2022 Present\xf3 la agrupaci\xf3n \u201cPrimero la Gente\u201d (2018\u20112019) con vocaci\xf3n ciudadana y enfoque progresista centrado en la participaci\xf3n social y la descentralizaci\xf3n.\n\u2022 Respald\xf3 la propuesta \u201cTarija segura\u201d, enfatizando en seguridad ciudadana mediante tecnolog\xedas como c\xe1maras de video\u2011vigilancia, aunque el sistema nunca funcion\xf3 plenamente y enfrent\xf3 denuncias judiciales.\n",A.b(["Cr\xedticas por mantener alianzas pol\xedticas cambiantes","Se\xf1alamientos por baja ejecuci\xf3n presupuestaria"],q),"\u2022 Fue cuestionado por conflictos internos con su antiguo partido UNIR, acusado de intentar \u201cdestruir UNIR\u201d para fortalecer su propio liderazgo a trav\xe9s de Primero la Gente.\n\u2022 Recibi\xf3 imputaciones judiciales por presuntas irregularidades en la adjudicaci\xf3n y construcci\xf3n del Puente 4 de Julio (\u201cPuente Millonario\u201d) durante su gesti\xf3n como alcalde, una obra criticada por su alto costo y falta de resultados inmediatos.\n\u2022 Su campa\xf1a presidencial en 2025 fue cuestionada por el PDC por considerar que su presentaci\xf3n como candidato fue impulsada unilateralmente, sin pasar por la conferencia nacional de dirigentes del partido.\n\u2022 Fue criticado por denunciar presuntas conspiraciones del MAS para suspender o sabotear las elecciones, lo que algunos sectores interpretaron como uso pol\xedtico del discurso acusatorio y polarizador.\n\u2022 Cuestion\xf3 la inacci\xf3n del Senado en aprobar cr\xe9ditos electorales (como el de 100 millones USD) calific\xe1ndolo de \u201csabotaje electoral\u201d, lo que gener\xf3 tensiones con otros legisladores por interpretar obstaculizaci\xf3n pol\xedtica m\xe1s que t\xe9cnica.\n\u2022 Su discurso en contra de alianzas entre partidos opositores fue criticado por algunos analistas y medios como un relato que divide m\xe1s que suma a la oposici\xf3n frente al oficialismo.\n","Piedra Papel y Tinta - La Razon 2025 \u2022 Cuestion\xf3 las alianzas entre partidos opositores calific\xe1ndolas de \u201cmezcla de intereses\u201d donde \u201cse est\xe1n sacando los ojos\u201d, lo que gener\xf3 cr\xedticas sobre su visi\xf3n poco colaborativa del bloque opositor.\n\u2022 Exigi\xf3 debates y rechaz\xf3 que se elija candidato solo por encuestas pagadas, pero recibi\xf3 cr\xedticas por vincular su ausencia a su falta de recursos econ\xf3micos.\n\u2022 Plante\xf3 medidas como rechazo a pr\xe9stamos del FMI y ejecuci\xf3n de reformas por decreto, lo cual algunos analistas interpretaron como propuestas radicales sin viabilidad democr\xe1tica.\nEl Pais-Tarija \u2022 Afirm\xf3 que \u201cno tiene plata para pagar encuestas como otros\u201d, deslegitimando el uso de encuestas y generando debate sobre equidad y financiaci\xf3n en campa\xf1a.\n\u2022 Denunci\xf3 falta de acceso equitativo a medios, afirmando que sin recursos econ\xf3micos no se puede participar en el debate electoral, lo que fue valorado como cr\xedtica directa al sistema medi\xe1tico.\nAnimal Politico-La Razon\u2022 Dio una fuerte cr\xedtica a la \u201cprivatizaci\xf3n de la democracia\u201d al denunciar que los debates est\xe1n controlados por medios privados que excluyen candidatos sin capacidad de pago.\n\u2022 Denunci\xf3 que solo ciertos candidatos tienen acceso medi\xe1tico durante la campa\xf1a (los que pagan), lo que calific\xf3 como un grave desequilibrio democr\xe1tico.\n\u2022 Aludi\xf3 a cinco crisis simult\xe1neas en el pa\xeds y denunci\xf3 la inexistencia de respaldo institucional del TSE ante este escenario, acusando falta de firmeza democr\xe1tica.\nDebate Presidencial Oficial \u2013 \u201cUno Decide\u201d\u2022 Denunci\xf3 que los debates oficiales son controlados por medios privados y candidatos con alto poder econ\xf3mico, lo que genera una \u201cprivatizaci\xf3n de la democracia\u201d y excluye voces emergentes como la suya.\n\u2022 Cuestion\xf3 la igualdad de condiciones en acceso a la palabra durante el debate, se\xf1alando que el financiamiento masivo de algunos candidatos desequilibra las oportunidades de participaci\xf3n democr\xe1tica.\n\u2022 Aludi\xf3 a la inacci\xf3n del TSE durante el debate, cuestionando que no haya garantizado la inclusi\xf3n plena de todos los postulantes, lo que profundiza la desigualdad electoral.\n",7,9,5,"assets/postulantes/PDC_Rodrigo_Paz.png",6,"Rodrigo Paz Pereira",6,6,7,g,"\u2022 Inici\xf3 su carrera pol\xedtica como diputado uninominal por Tarija entre 2002 y 2010, primero con el Movimiento de Izquierda Revolucionaria (MIR) y luego con Podemos, desarrollando una agenda parlamentaria enfocada en descentralizaci\xf3n y desarrollo regional.\n\u2022 Entre 2010 y 2015 fue presidente del Concejo Municipal de Tarija, y posteriormente fue elegido alcalde de esa ciudad para el per\xedodo 2015\u20132020, cargo desde el cual impuls\xf3 proyectos de infraestructura urbana, incluyendo el Puente 4 de Julio, obra que gener\xf3 controversia y procesos judiciales.\n\u2022 En 2020 fue electo senador por Tarija en la Asamblea Legislativa Plurinacional por la alianza Comunidad Ciudadana, desde donde ha promovido una agenda legislativa orientada al fortalecimiento institucional, la autonom\xeda regional y el control al poder ejecutivo.\n\u2022 Fund\xf3 la agrupaci\xf3n pol\xedtica \u201cPrimero la Gente\u201d en 2019, con la cual busca renovar el liderazgo opositor tradicional desde una visi\xf3n ciudadana y descentralizadora, distanci\xe1ndose de estructuras partidarias cl\xe1sicas.\n\u2022 En 2025 fue proclamado candidato presidencial por el Partido Dem\xf3crata Cristiano (PDC), apostando por una propuesta pol\xedtica basada en institucionalidad democr\xe1tica, valores cristiano-dem\xf3cratas y econom\xeda popular productiva.\n\u2022 Ha sido cr\xedtico del MAS y de la oposici\xf3n tradicional, y ha promovido espacios de debate p\xfablico como alternativa al pacto de \xe9lites, consolid\xe1ndose como una figura de centro reformista dentro del escenario pol\xedtico nacional.\n")
