f=A.dc("Candidato a la vicepresidencia por el PDC. De perfil t\xe9cnico-jur\xeddico.","\u2022 Edmand Lara Monta\xf1o es capit\xe1n de la Polic\xeda Boliviana, suspendido tras denunciar casos de corrupci\xf3n interna en unidades de Tr\xe1nsito y otros cargos, lo que le dio notoriedad p\xfablica a partir de 2022.\n\u2022 En enero de 2024 present\xf3 un proyecto pol\xedtico propio en Sucre bajo una plataforma que se declara \u201cni de izquierda ni de derecha\u201d, pero orientada por el patriotismo, honestidad y \u201cun solo rumbo\u201d de renovaci\xf3n institucional.\n\u2022 El 14 de marzo de 2025 fue proclamado candidato presidencial por un sector del transporte cruce\xf1o, present\xe1ndose como alternativa emergente frente a lo que calific\xf3 como \u201cpol\xedticos dinosaurios\u201d de la oposici\xf3n tradicional.\n\u2022 En su discurso plante\xf3 medidas como reducci\xf3n del Estado, incentivos tributarios al sector productivo, transparencia en justicia y cero presos pol\xedticos; adem\xe1s, critic\xf3 la crisis energ\xe9tica y la escasez de di\xe9sel como prioridad nacional.\n\u2022 Aunque sin experiencia pol\xedtica previa, su candidatura fue promovida como parte de una renovaci\xf3n que rechaza los bloques opositores tradicionales, considerando innecesarias alianzas con figuras establecidas como Quiroga o Doria Medina.\n\u2022 Se le menciona como posible candidato del Movimiento Tercer Sistema (MTS), aunque esa postulaci\xf3n depend\xeda de acuerdos internos y todav\xeda no fue ratificada oficialmente por el bloque pol\xedtico.\n",p,"\u2022 Es un excapit\xe1n de la Polic\xeda Boliviana que se hizo conocido por denunciar corrupci\xf3n interna, agresiones y cobros irregulares en la instituci\xf3n, lo que le otorg\xf3 visibilidad nacional como s\xedmbolo de lucha contra la corrupci\xf3n.\n\u2022 Su perfil se articula como figura emergente: joven (37\u201139 a\xf1os), sin trayectoria pol\xedtica tradicional, lo que le permite presentarse como opci\xf3n nueva frente a los \u201cpol\xedticos de siempre\u201d.\n\u2022 Ha sido valorado por analistas como potencial vicepresidente con capacidad para articular acuerdos pol\xedticos en la Asamblea Legislativa, dada su notoriedad p\xfablica y car\xe1cter propositivo.\n\u2022 Representa al segmento de l\xedderes j\xf3venes de la oposici\xf3n y tiene mayor posicionamiento entre los acompa\xf1antes de f\xf3rmula, alcanzando un 22,8\u202f% en preferencias seg\xfan sondeo nacional.\n\u2022 Su perfil no partidario le permite presentarse como independiente, con discurso antielitista y de renovaci\xf3n institucional, llamado a una alianza con nuevos candidatos y no con estructuras tradicionales.\n",A.b(["Defensor de valores tradicionales cristianos","Participaci\xf3n constante en debates"],q),"\u2022 Es un excapit\xe1n de la Polic\xeda Boliviana que gan\xf3 visibilidad nacional al denunciar corrupci\xf3n interna, cobros irregulares y abusos dentro de la instituci\xf3n, lo que lo posiciona como un s\xedmbolo de integridad y transparencia.\n\u2022 Ha sido valorado como una figura emergente joven e independiente, sin lazos con partidos tradicionales, lo que lo hace atractivo para los votantes que buscan renovaci\xf3n pol\xedtica.\n\u2022 Su capacidad de articulaci\xf3n p\xfablica fue reconocida cuando sell\xf3 una alianza con l\xedderes como Rodrigo Paz Pereira, mostrando habilidad para conectar con nuevos actores pol\xedticos y construir espacios ciudadanizados.\n\u2022 Diversos medios destacan su discurso enfocado en la lucha contra la corrupci\xf3n, la defensa de la institucionalidad y la justicia transparente; fue visto como voz moral frente al \u201csistema corrupto\u201d.\n\u2022 El sector de acompa\xf1antes de f\xf3rmula lo identifica como uno de los perfiles con mayor crecimiento y aceptaci\xf3n, superando figuras tradicionales por su frescura y propuesta ciudadana.\n",A.b(["Cr\xedticas por posiciones ultraconservadoras","Sin experiencia previa en gesti\xf3n p\xfablica"],q),"\u2022 Fue suspendido de la Polic\xeda Boliviana por denuncias de uso indebido de influencias, usurpaci\xf3n de funciones y estorbar unidades de atenci\xf3n, lo que gener\xf3 cuestionamientos sobre su conducta institucional.\n\u2022 Fue criticado por exponer p\xfablicamente casos de corrupci\xf3n dentro de la Polic\xeda, lo que deriv\xf3 en su imputaci\xf3n penal y una confrontaci\xf3n violenta con jerarqu\xedas como el comandante Holgu\xedn \u2014momento que algunos consideran lamentable y poco apto para una figura pol\xedtica.\n\u2022 Su perfil fue cuestionado como \u201cinevaluado pol\xedticamente\u201d: lo califican de populista sin estudios formales, sin experiencia pol\xedtica establecida y como alguien que podr\xeda ser funcional al sistema al dividir votos opositores.\n\u2022 Ha sido acusado por analistas y usuarios en redes de no poseer proyecto pol\xedtico claro, sino solo ideas generales sin planificaci\xf3n ni viabilidad t\xe9cnica para gobernar.\n\u2022 Fue se\xf1alado por detractores de alinearse con intereses del MAS de forma indirecta, al ser considerado por algunos como un candidato \u201c\xfatil\u201d para fragmentar el voto opositor.\n","Que no me pierda Julio 2025\u2022 Calific\xf3 a Eduardo del Castillo (candidato del MAS) como \u201ccorrupto y cobarde\u201d, afirmando que los rumores de v\xednculo con narcotr\xe1fico (Sebasti\xe1n Marset) son ciertos, lo que gener\xf3 fuerte rechazo y pol\xe9mica por su tono personal y no comprobado judicialmente.\n\u2022 Afirm\xf3 que Del Castillo fue responsable de su destituci\xf3n de la Polic\xeda y acus\xf3 que proteg\xeda redes del narcotr\xe1fico desde dentro del Estado, sin presentar pruebas claras, lo cual fue caracterizado como difamatorio por sectores cr\xedticos.\n\nUnitel Julio 2025\u2022 Denunci\xf3 p\xfablicamente sentirse \u201craleado\u201d y excluido del debate porque no invitaron oficialmente al MAS, reclamando igualdad de condiciones medi\xe1ticas en espacios electorales controlados por medios privados.\n\u2022 Afirm\xf3 que la campa\xf1a est\xe1 dominada por \u201cburbuja medi\xe1tica\u201d donde solo los candidatos con capacidad financiera tienen voz, lo que interpret\xf3 como falta de pluralidad democr\xe1tica.\nEl Deber Junio 2025\u2022 Critic\xf3 gravemente al gobierno de Luis Arce y a Evo Morales, afirmando que la Polic\xeda est\xe1 \u201crebasada\u201d y teme enfrentarse al \u201cevismo armado\u201d, lo que desat\xf3 pol\xe9mica por sus connotaciones b\xe9licas y extremas.\n\u2022 Exigi\xf3 intervenci\xf3n militar frente a bloqueos violentos, acusando a las FFAA de actuar con mas cautela seg\xfan el actor involucrado, lo que algunos sectores calificaron de invitaci\xf3n a la militarizaci\xf3n.\nCadena A Julio 2025\u2022 Afirm\xf3 que \u201cotros ser\xedan los resultados si yo hubiera ido como candidato presidencial en vez de vice\u201d, lo cual fue acusado como intento de desacreditar la f\xf3rmula y provocar divisiones internas dentro del PDC.\n\u2022 El enfoque en su propia figura gener\xf3 cr\xedticas por supuesta ambici\xf3n personal y falta de cohesi\xf3n con el \xfanico liderazgo de Rodrigo Paz.\n",4,10,5,"assets/postulantes/PDC_Edmand_Lara.png",5,"Edmand Lara Monta\xf1o",4,4,5,f,"\u2022 Es excapit\xe1n de la Polic\xeda Boliviana, famoso por denunciar casos de corrupci\xf3n interna y cobros irregulares en unidades policiales en 2022\u20112023, lo que le vali\xf3 notoriedad p\xfablica y su suspensi\xf3n definitiva.\n\u2022 Se defini\xf3 como independiente y present\xf3 su plataforma pol\xedtica \u201cNuevas Ideas con Libertad\u201d en 2024 en Sucre y Oruro, basada en una ideolog\xeda \u201cpatriota\u201d que busca superar la polarizaci\xf3n izquierda-derecha.\n\u2022 En julio de 2024 firm\xf3 una alianza pol\xedtica con Chi Hyun Chung denominada \u201cAcuerdo por la Reconstrucci\xf3n de la Patria\u201d, comprometi\xe9ndose a luchar contra la corrupci\xf3n y promover liderazgo emergente.\n\u2022 Camin\xf3 por todo el pa\xeds durante un a\xf1o promoviendo su movimiento y reclutando simpatizantes antes de su postulaci\xf3n formal, enfrentando limitaciones econ\xf3micas para consolidar una estructura partidaria propia.\n\u2022 El 18 de mayo de 2025 fue anunciado como candidato a la vicepresidencia junto a Rodrigo Paz Pereira por el Partido Dem\xf3crata Cristiano (PDC), tras la renuncia de Sebasti\xe1n Careaga, en una maniobra pol\xedtica de \xfaltima hora.\n\u2022 Su perfil se presenta como voz emergente contra el \u201csistema corrupto y enterrador\u201d, con \xe9nfasis en renovaci\xf3n institucional, justicia transparente, y protagonismo juvenil en la pol\xedtica.\n")
