e=A.dc("Pol\xedtico boliviano, ingeniero industrial y expresidente de Bolivia (2001\u20132002).","\u2022 Jorge Fernando \u201cTuto\u201d Quiroga Ram\xedrez naci\xf3 el 5 de mayo de 1960 en Cochabamba, Bolivia. Es ingeniero industrial egresado de Texas A&M y obtuvo un MBA en St. Edward\u2019s University, lo que sustenta su perfil t\xe9cnico\u2011administrativo.\n\u2022 Trabaj\xf3 en IBM en Texas entre 1981 y 1988, luego en el sector bancario y minero en Bolivia, lo que fortaleci\xf3 su experiencia en gesti\xf3n privada antes de entrar a la pol\xedtica.\n\u2022 Fue subsecretario de Inversi\xf3n P\xfablica y Cooperaci\xf3n Internacional (1989\u20131992) en el gobierno de Jaime Paz Zamora, y asumi\xf3 como Ministro de Finanzas en 1992, lo que lo posicion\xf3 como tecn\xf3crata joven y prometedor.\n\u2022 Fue electo vicepresidente de Bolivia (1997\u20112001) a los 37 a\xf1os, bajo el gobierno de Hugo Banzer \u2013 el m\xe1s joven en ocupar ese cargo en la historia del pa\xeds \u2013 y asumi\xf3 la presidencia interina en 2001 tras la renuncia de Banzer, completando el per\xedodo hasta 2002.\n\u2022 Desde su presidencia interina, promovi\xf3 pol\xedticas de estabilizaci\xf3n econ\xf3mica, apertura al libre mercado, privatizaci\xf3n parcial y atracci\xf3n de inversi\xf3n internacional; defendi\xf3 la necesidad de acuerdos con FMI y organismos multilaterales.\n\u2022 Fue candidato presidencial en 2005 (PODEMOS), 2014 (PDC) y 2020 (Libre 21), aunque se retir\xf3 justo antes de las votaciones para apoyar la unidad opositora en su \xfaltima postulaci\xf3n.\n\u2022 En diciembre de 2024 anunci\xf3 oficialmente su candidatura para 2025 con la alianza Libre (FRI\u2011MDS), posicion\xe1ndose como l\xedder opositor y promotor de reformas institucionales, separaci\xf3n de poderes y combate a lo que denomin\xf3 \u201cmodelo castro\u2011madurista\u201d.\n\u2022 Su perfil combina experiencia ejecutiva institucional, formaci\xf3n internacional, gesti\xf3n t\xe9cnica y una defensa consistente del liberalismo econ\xf3mico y la democracia institucional.\n",p,"\u2022 Cuenta con experiencia presidencial ejecutiva: fue vicepresidente (1997\u20132001) y asumi\xf3 la Presidencia de Bolivia (agosto 2001\u2013agosto 2002), lo que le confiere legitimidad institucional y conocimiento del gobierno nacional.\n\u2022 Formado acad\xe9micamente en Estados Unidos con t\xedtulo en ingenier\xeda industrial de Texas A&M (con honores) y un MBA en St. Edward\u2019s University, experiencia internacional que respalda su perfil t\xe9cnico y administrativo.\n\u2022 Trayectoria profesional en el sector privado, incluyendo cargos en empresas como IBM, lo que fortalece su perfil en gesti\xf3n moderna y enfoque orientado al libre mercado.\n\u2022 Como expresidente, impuls\xf3 pol\xedticas econ\xf3micas enfocadas en el libre mercado y atracci\xf3n de inversi\xf3n privada, defendiendo la privatizaci\xf3n parcial de empresas estatales y la reducci\xf3n del rol estatal en la econom\xeda.\n\u2022 Se present\xf3 como defensor de la institucionalidad democr\xe1tica: critic\xf3 violaciones constitucionales durante los gobiernos del MAS y propone reformas judiciales basadas en la meritocracia.\n\u2022 Propone una agenda de modernizaci\xf3n: fortalecer la democracia, instalar transparencia judicial, reactivar sectores clave como el gas y el litio mediante inversi\xf3n extranjera y fondos mutuos populares.\n\u2022 Es percibido como un l\xedder con respaldo internacional, capacidades de articulaci\xf3n pol\xedtica y defensa del principio de institucionalidad frente al autoritarismo y la corrupci\xf3n.\n",A.b(["Promotor de estabilidad econ\xf3mica en los 90s","Defensor de la democracia ante organismos internacionales","Impulsor de pol\xedticas de descentralizaci\xf3n"],q),"\u2022 Present\xf3 la iniciativa \u201cBolivia Digital\u201d, un plan integral de transformaci\xf3n tecnol\xf3gica que incluye Estado digital, apoyo a startups, criptomonedas y eficiencia administrativa, destacada como modelo de innovaci\xf3n y modernizaci\xf3n.\u202f\n\u2022 Defendi\xf3 una visi\xf3n de \u201crevoluci\xf3n propie\xadtaria liberal\u201d, proponiendo que los recursos estatales sean entregados como propiedad a todos los mayores de 18 a\xf1os, fortaleciendo la inclusi\xf3n econ\xf3mica ciudadana.\u202f\n\u2022 Propuso reforma parcial de la Constituci\xf3n para titular tierras individuales y bancarizar al productor rural, facilitando acceso a financiamiento y dinamizando el agro boliviano.\u202f\n\u2022 Impuls\xf3 pol\xedticas de transparencia judicial y sistema de meritocracia en selecci\xf3n de funcionarios, buscando profesionalizar la justicia y reducir la corrupci\xf3n estructural.\u202f\n\u2022 Durante su mandato como presidente (2001\u20132002) implement\xf3 medidas de estabilizaci\xf3n econ\xf3mica, apertura comercial, reducci\xf3n del d\xe9ficit fiscal y programas sociales para poblaci\xf3n vulnerable.\u202f\n\u2022 Ha promovido el di\xe1logo y acuerdos con l\xedderes sociales e ind\xedgenas de manera respetuosa, priorizando la integraci\xf3n y el respeto cultural en negociaciones pol\xedticas.\u202f\n\u2022 Ha construido una imagen de l\xedder pragm\xe1tico, con capacidad de articular alianzas pol\xedticas y propuestas en foros internacionales (como la Fundaci\xf3n Tuto Quiroga), orientando su discurso en torno a la institucionalidad democr\xe1tica.\u202f\n",A.b(["Criticado por ser continuador del modelo neoliberal","Asociado al gobierno de Banzer","Acusaciones por v\xednculos con grupos conservadores"],q),"\u2022 Fue cuestionado por quebrar el pacto del bloque opositor al rechazar encuestas internas para definir candidatura \xfanica, lo que rompi\xf3 la unidad y gener\xf3 reproches de Mesa, Camacho y A\xf1ez.\n\u2022 Utiliz\xf3 argumentos jur\xeddicos (Ley 026) para obstruir el proceso de encuestas del bloque, considerados como una maniobra legal sin fundamento para retrasar la definici\xf3n del candidato y favorecer su campa\xf1a.\n\u2022 Su cr\xedtica al gobierno por el \u201ccaso consorcio\u201d fue calificada como ret\xf3rica pol\xedtica dura sin evidencia concreta, acusando manipulaci\xf3n judicial sistem\xe1tica sin respaldo verificable.\n\u2022 Se le adjudic\xf3 la difusi\xf3n de un video falso que supuestamente dec\xeda que ser\xeda razonable privar a los ind\xedgenas de sus derechos pol\xedticos; la verificaci\xf3n digital determin\xf3 que se trataba de un deepfake.\n\u2022 Fue criticado por interferir en debates electorales y denuncias de \u201cburbuja medi\xe1tica\u201d, acusando a candidatos con recursos versus a quienes no pueden costear propaganda, lo cual fueron interpretadas como sobrerreacciones.\n\u2022 Su rechazo a encuestas y alianza con Doria Medina fue visto por algunos sectores como ambici\xf3n personal y falta de compromiso con los acuerdos firmados dentro del bloque opositor.\n\u2022 Analistas y usuarios en redes consideraron que, pese a su experiencia, carece del carisma necesario y que su estilo tecnocr\xe1tico puede desconectar del electorado m\xe1s amplio.\n","Uno Decide  7 de julio de 2025\u2022 Afirm\xf3: \u201cVamos a parar la gastadera y robadera\u2026 Quipus no sirvi\xf3 de absolutamente nada\u201d, lo que gener\xf3 cr\xedticas por su discurso confrontacional y acusaciones de corrupci\xf3n sistem\xe1tica sin presentar pruebas concretas.\n\u2022 Propuso que cada ciudadano mayor de 18 sea sujeto de cr\xe9dito con tierra individual y participaci\xf3n en fondos de inversi\xf3n, lo cual fue interpretado como promesa populista y dif\xedcil de implementar.\n\nUnitel Debate sobre Autonom\xeda  21 de julio de 2025\u2022 Propuso reducir la participaci\xf3n del gobierno central del 80\u202f% al 62\u202f% en el presupuesto, lo que provoc\xf3 debate por presunta falta de respaldo t\xe9cnico y viabilidad fiscal.\n\u2022 Ret\xf3 a Doria Medina con la pregunta: \u201c\xbfRespaldas la autonom\xeda total?\u201d, favoreciendo la descentralizaci\xf3n radical, lo que fue criticado como desequilibrado y sin propuestas de financiamiento alternativo.\n\nDebate Unitel sobre econom\xeda y litio  julio de 2025\u2022 Se enfrent\xf3 a Manfred por su apuesta al FMI versus explotaci\xf3n del litio, defendiendo su m\xe9todo de cr\xe9ditos externos, lo cual gener\xf3 cuestionamientos sobre carga fiscal e independencia econ\xf3mica.\n\u2022 Prometi\xf3 estabilizar el pa\xeds en cuatro semanas, acusando al gobierno de \u201cgastadera sin reinversi\xf3n\u201d; algunos analistas se\xf1alaron que su discurso simplifica problemas estructurales.\n\nLa Raz\xf3n \u2013 Entrevista \u201cTuto va por un cambio radical\u201d  31 de mayo de 2025\u2022 Asegur\xf3 que Bolivia es percibida como santuario de narcos (Marset, PCC, Comando Vermelho), acusaciones que causaron pol\xe9mica por su tono alarmista y falta de pruebas judiciales.\n\u2022 Critic\xf3 la violaci\xf3n de la Constituci\xf3n por parte de Morales y Arce, denunciando un \u201cestado de capricho\u201d; algunos medios lo consideraron excesivamente confrontativo sin ofrecer di\xe1logo institucional.\n\nEl Deber \u2013 Entrevista respuesta a Evo Morales  20 de marzo de 2025\u2022 Lo acus\xf3 de \u201csaquear\u201d gas, d\xf3lares e inflaci\xf3n, calificando a Evo Morales y a Luis Arce como la \u201cyunta saqueadora\u201d; este lenguaje fue visto como polarizante y ofensivo.\n\nRed Uno \u2013 Debate sobre reforma judicial  7 de enero de 2025\u2022 Propuso reformar el sistema judicial mediante meritocracia y acabar con la influencia pol\xedtica; fue criticado por no explicar c\xf3mo se implementar\xeda en un contexto con baja institucionalidad.\n\nRed Uno \u2013 Entrevista sobre el calendario electoral  3 de enero de 2025\u2022 Denunci\xf3 que el MAS usa el Bicentenario para promoverse pol\xedticamente y pidi\xf3 postergar las elecciones, lo cual fue interpretado como intento de posponer el calendario electoral.\n\n",9,11,6,u.Z,7,"Jorge Quiroga Ram\xedrez",5,8,5,e,"\u2022 Naci\xf3 el 5 de mayo de 1960 en Cochabamba; es ingeniero industrial de la Universidad Texas\u202fA&M y obtuvo un MBA en la Universidad St. Edward\u2019s, ambos en EE.\u202fUU., fortaleciendo su perfil t\xe9cnico\u2011administrativo.\n\u2022 Trabaj\xf3 en el sector privado internacional \u2014incluyendo IBM en Texas y la empresa minera Mintec\u2014 antes de entrar a la funci\xf3n p\xfablica, lo que le confiere experiencia en gesti\xf3n moderna y econom\xeda.\n\u2022 Inici\xf3 su carrera p\xfablica como subsecretario de Inversi\xf3n P\xfablica (1989) y Ministro de Finanzas (1992), consolid\xe1ndose como tecn\xf3crata econ\xf3mico antes de su elecci\xf3n como vicepresidente.\n\u2022 Fue electo vicepresidente de Bolivia en 1997 y asumi\xf3 la Presidencia en agosto de 2001 tras la renuncia de Hugo Banzer; ejerci\xf3 plenamente hasta agosto de 2002, siendo uno de los presidentes m\xe1s j\xf3venes del pa\xeds.\u200b\n\u2022 Durante su gobierno interino promovi\xf3 pol\xedticas de estabilizaci\xf3n macroecon\xf3mica, privatizaciones parciales, apertura al libre mercado y atracci\xf3n de inversi\xf3n extranjera como pilares de su modelo econ\xf3mico.\n\u2022 Fund\xf3 y lider\xf3 el partido Podemos en 2005 y fue candidato presidencial ese mismo a\xf1o (obtuvo 28\u202f% de los votos), y tambi\xe9n se postul\xf3 en 2014 y 2020, aunque en esta \xfaltima declin\xf3 para apoyar la unidad opositora.\u200b\n\u2022 En diciembre de 2024 oficializ\xf3 su candidatura para las elecciones 2025 bajo la alianza \u201cLibre\u201d (FRI\u2011MDS), respaldada por partidos y figuras de la oposici\xf3n tradicional, reclamando la reconstrucci\xf3n institucional del Estado.\u200b\n\u2022 Se destaca por su experiencia ejecutiva, su perfil internacional y t\xe9cnica, su defensa de la institucionalidad democr\xe1tica, y su visi\xf3n liberal\u2011libertaria en lo econ\xf3mico y pol\xedtico.\n")
