d=A.dc("Abogado constitucionalista, docente universitario y analista pol\xedtico.","\u2022 Naci\xf3 el 9 de abril de 1987 en Santa Cruz de la Sierra; emprendi\xf3 estudios universitarios en Argentina y trabaj\xf3 en empresas multinacionales tecnol\xf3gicas.\n\u2022 Cofund\xf3 Netcomidas en 2015, la primera plataforma boliviana de delivery de alimentos, vendida a PedidosYa en 2018 en la mayor operaci\xf3n de este tipo en el mercado nacional.\n\u2022 Lider\xf3 la expansi\xf3n en Am\xe9rica Latina de Yango (servicios de taxi, mensajer\xeda y delivery), fortaleciendo su perfil como ejecutivo tecnol\xf3gico internacional.\n\u2022 Fund\xf3 la fintech PRESTO, primera empresa boliviana certificada VISA\u202fTPA, habilitada para emitir tarjetas de cr\xe9dito en mercados emergentes de Am\xe9rica Latina.\n\u2022 Cofund\xf3 MOBI LATAM, startup dedicada a energ\xeda limpia y micromovilidad urbana, considerada la empresa tecnol\xf3gica m\xe1s valiosa de Bolivia por su capacidad de atraer inversi\xf3n internacional.\n\u2022 En mayo de 2025 fue presentado como candidato a la vicepresidencia por la alianza Libre, acompa\xf1ando a Jorge \u201cTuto\u201d Quiroga, posicion\xe1ndose como figura emergente de renovaci\xf3n tecnol\xf3gica.\n\u2022 Su propuesta se enfoca en la transformaci\xf3n digital del Estado, atracci\xf3n de inversi\xf3n extranjera, empoderamiento juvenil y modernizaci\xf3n institucional.\n",p,"\u2022 Es emprendedor tecnol\xf3gico de amplia trayectoria en Bolivia y Am\xe9rica Latina: cofundador de Netcomidas, l\xedder de expansi\xf3n de Yango, fundador de MOBI LATAM y PRESTO, lo que le otorga experiencia en gesti\xf3n digital e innovaci\xf3n.\n\u2022 Ha generado impacto social mediante la creaci\xf3n de decenas de miles de empleos (~55.000), distribuidos por todo Bolivia, lo que los medios resaltan como prueba de su capacidad para dinamizar la econom\xeda digital.\n\u2022 Se presenta como s\xedmbolo de renovaci\xf3n pol\xedtica joven e independiente, sin antecedentes partidarios, lo cual le da credibilidad frente a votantes que rechazan la politiquer\xeda tradicional.\n\u2022 Destaca su visi\xf3n para digitalizar el Estado: propone tr\xe1mites desde el celular, acabar con la burocracia, transparencia institucional y creaci\xf3n de una Asamblea Digital que deje de ser una \u201ccaja negra\u201d.\n\u2022 Ha sido valorado por su capacidad de conectar con el electorado juvenil y emprendedor mediante una narrativa moderna, aut\xe9ntica y alineada con tecnolog\xedas emergentes como IA y criptomonedas.\n\u2022 Reconocido por medios por una selecci\xf3n como candidato basada en an\xe1lisis t\xe9cnico y de mercado, no en dedazos; esto reforz\xf3 su legitimidad y solidez como perfil emergente del binomio.\n",A.b(["Promotor del respeto al orden constitucional","Participaci\xf3n activa en debates"],q),"\u2022 Reconocido como emprendedor tecnol\xf3gico con trayectoria internacional: cofundador de Netcomidas (adquirida por PedidosYa), l\xedder en expansi\xf3n regional de Yango, fundador de PRESTO y MOBI LATAM, lo que refleja su perfil s\xf3lido en innovaci\xf3n y gesti\xf3n.\n\u2022 Considerado el primer \u201cvicepresidente tecnol\xf3gico\u201d de Bolivia, con visi\xf3n para transformar el Estado digitalmente, apostando por tr\xe1mites m\xf3viles, transparencia institucional y modernizaci\xf3n administrativa.\n\u2022 Su impacto econ\xf3mico se evidencia en la generaci\xf3n de miles de empleos directos e indirectos en el sector tecnol\xf3gico y la creaci\xf3n de productos financieros digitales, lo que los medios critican como puntual en innovaci\xf3n regional.\n\u2022 Presentado como s\xedmbolo de renovaci\xf3n generacional e independencia pol\xedtica, sin trayectoria dentro de partidos tradicionales; encarna una opci\xf3n joven que complementa la experiencia de Quiroga.\n\u2022 Propone mecanismos de inclusi\xf3n tecnol\xf3gica como capital semilla para startups juveniles y una Legislatura Digital para mejorar la transparencia del parlamento mediante tecnolog\xeda.\n\u2022 Destacado por su capacidad de articular propuestas tecnol\xf3gicas alineadas con las expectativas de votantes j\xf3venes, emprendedores y sectores digitales basados en criptomonedas e innovaci\xf3n.\n",A.b(["Cr\xedticas por falta de experiencia administrativa","Vinculaci\xf3n con sectores liberales con bajo respaldo"],q),"\u2022 Fue cuestionado por reconocer p\xfablicamente su falta de experiencia pol\xedtica y legislativa, afirmando \u201cno s\xe9 mucho de pol\xedtica\u2026 estoy en cero\u201d, lo cual gener\xf3 dudas sobre su preparaci\xf3n para ejercer funciones en la Asamblea Legislativa Plurinacional.\n\u2022 Se le critic\xf3 por lanzar la frase \u201chacer sexy trabajar en el Estado\u201d, lo que fue calificado por medios y redes como un gesto de inmadurez o falta de seriedad en el discurso p\xfablico.\n\u2022 Cometi\xf3 un lapsus durante un acto c\xedvico al confundir la efem\xe9ride de La Paz con Cochabamba, error que se viraliz\xf3 como muestra de desconocimiento institucional.\n\u2022 Fue se\xf1alado por legisladores y analistas por tener escasa visi\xf3n pol\xedtica y d\xe9bil formaci\xf3n legislativa, consider\xe1ndolo limitado para desempe\xf1ar un rol clave en el Parlamento como vicepresidente nato.\n\u2022 En el debate UNITEL fue cuestionado por su error al usar la palabra \u201ccohete\u201d en vez de \u201csat\xe9lite\u201d al referirse al Tupac Katari; el lapsus fue usado para cuestionar su dominio t\xe9cnico y comunicaci\xf3n p\xfablica.\n","Debate UNITEL sobre vicepresidencia \u2013 27 de julio de 2025\u2022 Fue objeto de un cruce con Jos\xe9 Luis Lupo por referirse al sat\xe9lite Tupac Katari como \u201ccohete\u201d, un lapsus que fue utilizado para cuestionar su comunicaci\xf3n p\xfablica y dominio t\xe9cnico.\n\u2022 Asegur\xf3 que el internet en Bolivia es caro y lento con solo 22\u202f% de cobertura en escuelas p\xfablicas; su intervenci\xf3n fue calificada como alarmista y carente de propuestas concretas para cerrar esa brecha digital.\n\nDebate eju.tv sobre crisis econ\xf3mica y legislativa \u2013 julio de 2025\u2022 Propuso eliminar subsidios a empresas estatales no viables asegurando \u201csi no funcionan sin subsidio, que cierren\u201d, lo que gener\xf3 preocupaciones por posible desempleo y p\xe9rdida de servicios p\xfablicos.\n\u2022 Mencion\xf3 que se busca evitar la circulaci\xf3n de \u201cmaletines\u201d en votaciones legislativas, una acusaci\xf3n directa sobre corrupci\xf3n en la Asamblea, sin presentar evidencia precisa.\n\nEntrevista Unitel \u2013 programa As\xed Decidimos, 28 de mayo de 2025\u2022 Fue consultado sobre posibilidad de unidad opositora; evit\xf3 comprometerse con una f\xf3rmula concreta, generando cr\xedticas por falta de claridad pol\xedtica y ambig\xfcedad estrat\xe9gica.\n\nEntrevista Unitel/YouTube \u2013 mayo\u2011junio de 2025\u2022 Declar\xf3 que su objetivo era \u201cvolver a hacer sexy\u201d el trabajo en el Estado, frase que fue ampliamente criticada en redes por ser inmadura y poco seria para un cargo p\xfablico.\n\u2022 Habl\xf3 de leyes incendiarias y propuso penas r\xedgidas por maltrato animal, lo cual fue visto como ret\xf3rica sensacionalista m\xe1s que una propuesta legislativa robusta.\n\nDesfile de la Revoluci\xf3n de La Paz \u2013 entrevista en julio de 2025\u2022 Confundi\xf3 la efem\xe9ride de La Paz con Cochabamba durante un acto oficial, lo que se viraliz\xf3 como error simb\xf3lico y falta de conocimiento institucional.\n\n",5,12,6,u.L,4,"Juan Pablo Velasco Dalence",3,6,4,d,'\u2022 Empresario tecnol\xf3gico cruce\xf1o, naci\xf3 el 9 de abril de 1987; estudi\xf3 en Argentina y trabaj\xf3 en empresas multinacionales del sector digital antes de regresar a Bolivia.\n\u2022 Cofund\xf3 Netcomidas en 2015, la primera plataforma boliviana de delivery de alimentos, vendida en 2018 a PedidosYa en la mayor operaci\xf3n de ese tipo en el pa\xeds.\n\u2022 Lider\xf3 la expansi\xf3n regional de Yango en Am\xe9rica Latina, generando m\xe1s de 50.000 empleos entre conductores y repartidores en la regi\xf3n.\n\u2022 Fund\xf3 la fintech PRESTO (primera empresa boliviana certificada VISA TPA) y MOBI LATAM, dedicada a micromovilidad urbana y energ\xeda limpia, considerada la startup m\xe1s valiosa del pa\xeds.\n\u2022 Fue presentado el 15 de mayo de 2025 como candidato a la vicepresidencia por la alianza Libre, acompa\xf1ando a Jorge "Tuto" Quiroga, como figura emergente de renovaci\xf3n tecnol\xf3gica.\n\u2022 Su propuesta gira en torno a la transformaci\xf3n digital del Estado, modernizaci\xf3n institucional, inclusi\xf3n juvenil, econom\xeda digital y transparencia mediante innovaci\xf3n tecnol\xf3gica.\n')
