c=A.dc("Pol\xedtica y soci\xf3loga boliviana. Fue presidenta del Senado y actualmente es alcaldesa de El Alto.","\u2022 Naci\xf3 el 3 de enero de 1987 en El Alto, en una familia aymara de siete hermanos; hizo su bachillerato en La Paz y se gradu\xf3 como licenciada en Trabajo Social en la Universidad P\xfablica de El Alto (UPEA) en 2011, destac\xe1ndose desde joven en liderazgo estudiantil.\n\u2022 Fue delegada universitaria, dirigente del centro de estudiantes y secretaria general de la Federaci\xf3n Universitaria Local de la UPEA (2009\u20132011), lo que marc\xf3 su ingreso pol\xedtico desde la base acad\xe9mica y social.\n\u2022 Gan\xf3 una curul como senadora por La Paz en 2014 con el MAS-IPSP y asumi\xf3 el cargo en enero de 2015, manteni\xe9ndose en esa funci\xf3n hasta noviembre de 2020, cuando fue electa presidenta del Senado durante la crisis post\u2011Morales (noviembre de 2019\u2013noviembre de 2020).\n\u2022 En mayo de 2021 asumi\xf3 como alcaldesa de El Alto (2021\u20132026), tras ganar con aproximadamente el 67\u202f% de los votos como candidata por Jallalla La Paz, siendo reconocida como la revelaci\xf3n pol\xedtica de esa regi\xf3n.\n\u2022 En agosto de 2021 fue expulsada de Jallalla por desacuerdos con Leopoldo Chui, tras lo cual cre\xf3 su propio movimiento, RenueEva (luego Morena), conservando la mayor\xeda de concejales en el municipio de El Alto.\n\u2022 En 2022 fue reconocida internacionalmente como l\xedder emergente: incluida por la revista *Time* en su lista TIME100\xa0Next y en la lista de \u201c100 mujeres destacadas\u201d de la BBC.\n\u2022 Su perfil combina activismo social, identidad ind\xedgena alte\xf1a, formaci\xf3n t\xe9cnica en trabajo social y experiencia legislativa y ejecutiva, siendo considerada una figura clave de renovaci\xf3n pol\xedtica y l\xedder regional con proyecci\xf3n nacional.\n",p,"\u2022 Fue reconocida en 2022 por la revista TIME en su lista TIME100 Next como una de las 100 l\xedderes emergentes del mundo, lo que resalta su rol como figura pol\xedtica global y su vocaci\xf3n democr\xe1tica e ind\xedgena.\n\u2022 La BBC la incluy\xf3 tambi\xe9n entre las \u201c100 mujeres m\xe1s influyentes\u201d, destacando su victoria electoral en El Alto con cerca del 69\u202f% de los votos y su capacidad para movilizar bases populares.\n\u2022 Fue elegida presidenta del Senado (noviembre 2019 \u2013 noviembre 2020), asumiendo en plena crisis del MAS-IPSP y liderando una transici\xf3n institucional clave desde El Alto.\n\u2022 Como alcaldesa de El Alto desde mayo de 2021 gan\xf3 con amplia votaci\xf3n (67\u202f%), consolid\xe1ndose como una l\xedder regional con capacidad de gobernar la segunda ciudad m\xe1s poblada del pa\xeds.\n\u2022 Se destaca por su vinculaci\xf3n acad\xe9mica y social con la juventud alte\xf1a: fue dirigente estudiantil en la UPEA, lo que sustenta su liderazgo desde la base social y su empat\xeda con comunidades ind\xedgenas.\n\u2022 Ha sido valorada por construir su propio movimiento pol\xedtico (RenueEva / MORENA), evidenciando independencia, liderazgo aut\xf3nomo y capacidad de retener representaci\xf3n municipal.\n\u2022 Su estilo conciliador fue resaltado en medios como Am\xe9ricas Quarterly: supo balancear identidad ind\xedgena, di\xe1logo ciudadano y negociaci\xf3n pol\xedtica durante crisis nacionales.\n",A.b(["Rescat\xf3 institucionalidad en medio de la crisis post\u20112019","Ejecut\xf3 proyectos sociales en El Alto","Defiende la autonom\xeda pol\xedtica frente al MAS tradicional"],q),"\u2022 Su victoria en la elecci\xf3n municipal de El Alto en marzo de 2021 fue un triunfo con el 68,7\u202f% de los votos (m\xe1s de 406.000 votos), lo que represent\xf3 legitimidad absoluta en una ciudad considerada basti\xf3n del MAS. Su triunfo marc\xf3 el inicio de una nueva era pol\xedtica.\u202f\n\u2022 Como alcaldesa, implement\xf3 el plan \u201cAjayu\u201d con cinco ejes estrat\xe9gicos (social, cultural, educativo, productivo y tecnol\xf3gico), enfocados en transformar El Alto en una ciudad moderna y competitiva sin perder identidad cultural.\u202f\n\u2022 Lanz\xf3 el \u201cPlan Integral de la Mujer\u201d para El Alto, orientado a fortalecer los derechos de las mujeres, crear centros de acogida y empoderamiento femenino, y combatir la violencia de g\xe9nero mediante educaci\xf3n y asistencia social.\u202f\n\u2022 Promovi\xf3 iniciativas de integraci\xf3n econ\xf3mica como la participaci\xf3n de El Alto en Expocruz (presente con un pabell\xf3n propio y producci\xf3n local femenina), fomentando alianzas con Santa Cruz y visibilizando emprendimientos alte\xf1os.\u202f\n\u2022 Durante un evento en Harvard gener\xf3 atenci\xf3n internacional al plantear la necesidad de un \u201cpacto social y pol\xedtico\u201d para superar la crisis boliviana, enfatizando di\xe1logo, consenso y escucha entre l\xedderes, lo que fue visto como capacidad diplom\xe1tica y reflexiva.\u202f\n",A.b(["Cr\xedticas por ejecuci\xf3n presupuestaria moderada","Tensiones con sectores vecinales"],q),"\u2022 Fue acusada por la concejal Wilma Alanoca de falta de obras visibles y abandono urbano, con calles llenas de baches y desorden en la Ceja de El Alto, atribuy\xe9ndole gesti\xf3n deficiente.\n\u2022 Recibi\xf3 fuertes cr\xedticas por firmar un acuerdo con el sector de transporte (choferes) sin respaldo del Concejo Municipal, considerado como ilegal y sin seguridad jur\xeddica para vecinos y transportistas.\n\u2022 Vecinos calificaron su gesti\xf3n como \u201ccero y mentirosa\u201d, denunciando que El Alto permaneci\xf3 en las mismas condiciones de antes, sin inversiones estructurales significativas.\n\u2022 Fue se\xf1alada por realizar frecuentes viajes al extranjero (Alemania, Polonia, EE. UU., Turqu\xeda) sin presentar informes ni beneficios concretos para su municipio, lo que fue interpretado como abandono de la gesti\xf3n.\n\u2022 Se le reproch\xf3 confundir Efem\xe9rides de La Paz con Cochabamba durante actos oficiales y lapsus en comunicaci\xf3n p\xfablica, usado para cuestionar su cercan\xeda institucional y coherencia discursiva.\n\u2022 Fue expulsada de la agrupaci\xf3n Jallalla La Paz por \u201ctraici\xf3n\u201d a la ciudad y al convenio firmado con el partido, tras desvincularse de esa alianza sin consultar participaci\xf3n municipal.\n\u2022 Gremialistas de El Alto iniciaron un proceso de revocatoria alegando ineficiencia, incumplimiento de promesas y excesivos viajes que dejaron al municipio sin liderazgo ni obras.\n\u2022 Fue cuestionada por implementar normativas municipales pol\xe9micas, como la autorizaci\xf3n del uso de di\xf3xido de cloro para el COVID-19 sin aval cient\xedfico, lo que provoc\xf3 alertas sobre medidas irresponsables.\n","DTV \u2013 entrevista sobre vocer\xeda y di\xe1logo pol\xedtico  4 de junio de 2025\u2022 Aclar\xf3 p\xfablicamente que F\xe9lix Patzi no es vocero oficial de Morena ni de la izquierda, pidiendo evitar confusiones pol\xedticas; algunos medios interpretaron esto como una estrategia para distanciarse de figuras asociadas al pasado.\u200b\n\u2022 Hizo un llamado a debatir ideas sin estigmas ideol\xf3gicos, lo que algunos cr\xedticos vieron como discurso ambiguo que evita definir claramente su posici\xf3n dentro del espectro pol\xedtico.\u200b\n\nERBOL \u2013 entrevista sobre modelo h\xedbrido  27 de junio de 2025\u2022 Propuso un modelo estatal \u201ch\xedbrido\u201d que combine lo p\xfablico y lo privado, mencionando la necesidad de trabajar con el sector privado; sectores m\xe1s esc\xe9pticos criticaron que esto contradice la plataforma de izquierda y genera desconfianza sobre su independencia ideol\xf3gica.\u200b\n\u2022 Denunci\xf3 la existencia de \u201cnegocios de compadrazgo\u201d en el Estado, lo que gener\xf3 cuestionamientos por falta de datos concretos y podr\xeda haber debilitado alianzas con organizaciones populares.\u200b\n\nOpinion (Radio Fides) \u2013 entrevista sobre posible retiro  10 de julio de 2025\u2022 Afirm\xf3 que su candidatura no concluir\xe1 si se retiran por falta de recursos o ataques: \u201cno ser\xe1 porque somos cobardes\u201d, provocando debate sobre la viabilidad pol\xedtica de continuar con campa\xf1a sin estructura ni fondos.\u200b\n\u2022 Se\xf1al\xf3 ataques de otras fuerzas pol\xedticas como factor que podr\xeda influir en su decisi\xf3n, lo que fue interpretado como narrativa victimista m\xe1s que defensiva.\u200b\n\n",7,13,7,"assets/postulantes/MORENA_Eva_Copa.png",9,"M\xf3nica Eva Copa Murga",8,6,9,c,"\u2022 Naci\xf3 el 3 de enero de 1987 en El Alto (La Paz), en una familia aymara de siete hijos; estudios de Trabajo Social en la Universidad P\xfablica de El Alto (UPEA), gradu\xe1ndose en 2011 tras destacarse como l\xedder estudiantil en la Federaci\xf3n Universitaria Local (2009\u20132011).\n\u2022 Fue delegada de curso, dirigente del centro de estudiantes y secretaria general de la Federaci\xf3n Universitaria Local de la UPEA, donde defendi\xf3 derechos de j\xf3venes, mujeres y poblaciones vulnerables como activista social.\n\u2022 Elegida senadora por La Paz en 2014 (MAS-IPSP), asumi\xf3 en enero de 2015; en noviembre de 2019 fue electa presidenta del Senado durante la crisis post\u2011Morales, cargo en el cual facilit\xf3 la convocatoria a nuevas elecciones nacionales.\n\u2022 En 2021 fue electa alcaldesa de El Alto con aproximadamente el 67\u202f% de los votos bajo la alianza Jallalla La Paz; luego fue expulsada del MAS y fund\xf3 su propio movimiento RenueEva (luego Morena), consolidando liderazgo regional.\n\u2022 Mantiene su alcald\xeda desde mayo de 2021, impulsando planes municipales como el programa Ajayu, proyectos urbanos, sociales y educativos para El Alto, mientras coordina con diversos actores sociales.\n\u2022 Su perfil combina activismo social e identidad ind\xedgena con experiencia legislativa (como senadora y presidenta del Senado) y ejecutiva (como alcaldesa de la segunda ciudad m\xe1s poblada de Bolivia).\n")
