b=A.dc("Comunicador, analista pol\xedtico y exvocero presidencial del gobierno de Luis Arce.","\u2022 Jorge Guillermo Richter Ram\xedrez es polit\xf3logo boliviano formado en an\xe1lisis pol\xedtico, experiencia forjada en medios independientes como el semanario \u201cEl Juguete Rabioso\u201d y el programa \u201cTiempo de Opini\xf3n\u201d, donde destac\xf3 por su criterio riguroso y reflexivo.\n\u2022 En diciembre de 2020 fue designado vocero presidencial por el presidente Luis Arce Catacora, cargo que desempe\xf1\xf3 como coordinador directo de comunicaciones estatales hasta su renuncia en junio de 2024. Su vocer\xeda se caracteriz\xf3 por tono dialogante y llamado al pluralismo pol\xedtico.\u202f:contentReference[oaicite:1]{index=1}\n\u2022 Durante su gesti\xf3n como vocero, fue interlocutor clave en crisis institucionales como el rechazo de la reelecci\xf3n de Evo Morales y la transici\xf3n democr\xe1tica post\u20112019; defendi\xf3 la necesidad de di\xe1logo y acuerdos amplios para la gobernabilidad.\u202f:contentReference[oaicite:2]{index=2}\n\u2022 Tras renunciar, public\xf3 una carta abierta a Arce (junio 2024) donde alert\xf3 sobre actores que buscan debilitar al Gobierno, enfatizando la urgencia de fortalecer la institucionalidad y convocar pactos sociales amplios.\u202f:contentReference[oaicite:3]{index=3}\n\u2022 El 20 de mayo de 2025 fue registrado como candidato a la vicepresidencia por el partido MORENA, liderado por Eva Copa, integrando una f\xf3rmula que busca capitalizar su perfil de analista independiente y articulador pol\xedtico.\u202f:contentReference[oaicite:4]{index=4}\n\u2022 Su perfil combina vocaci\xf3n t\xe9cnico-intelectual, estilo anal\xedtico y compromiso con la democracia deliberativa. Es visto como una figura de transici\xf3n c\xedvico\u2011pol\xedtica, capaz de tender puentes entre movimientos urbanos y la institucionalidad estatal.\u202f:contentReference[oaicite:5]{index=5}\n",p,"\u2022 Es polit\xf3logo de formaci\xf3n con trayectoria anal\xedtica en medios independientes como \u201cEl Juguete Rabioso\u201d y \u201cTiempo de Opini\xf3n\u201d, donde desarroll\xf3 reputaci\xf3n por su criterio cr\xedtico, independiente y reflexivo.\n\u2022 Su labor como vocero presidencial entre diciembre de 2020 y junio de 2024 lo consolid\xf3 como interlocutor institucional clave, capaz de comunicar la visi\xf3n del Ejecutivo en temas sensibles de forma clara y reconocida por medios como El Deber y Vision360.\n\u2022 En entrevistas con La Raz\xf3n y Red Uno abord\xf3 crisis como el declive de la representaci\xf3n pol\xedtica y la decadencia del sistema judicial, demostrando capacidad para an\xe1lisis de coyuntura pol\xedtica y diagn\xf3stico estructural del pa\xeds.\n\u2022 Ha defendido la libertad de prensa frente a medios cr\xedticos al Gobierno, afirmando que no se ejerce censura estatal; aport\xf3 un discurso de respeto democr\xe1tico aunque contundente en la defensa institucional.\n\u2022 Fue valorado por su capacidad para promover una visi\xf3n de plurinacionalidad inclusiva, articulando respeto a los pueblos ind\xedgenas y a la diversidad cultural como pilares de la institucionalidad democr\xe1tica.\n\u2022 Como candidato a la vicepresidencia por MORENA en 2025, fue presentado como voz moderada y reflexiva dentro del binomio, capaz de tender puentes entre la ciudad de El Alto, organizaciones sociales y estructuras estatales.\n",A.b(["Promotor de una comunicaci\xf3n pol\xedtica racional","Ha impulsado el debate pol\xedtico sin confrontaci\xf3n"],q),"\u2022 Reconocido polit\xf3logo con una s\xf3lida trayectoria como analista independiente en medios cr\xedticos como \u201cEl Juguete Rabioso\u201d y \u201cTiempo de Opini\xf3n\u201d, donde construy\xf3 una reputaci\xf3n por su criterio reflexivo y fundamentado.\n\u2022 Ejerci\xf3 como vocero presidencial de Luis Arce entre diciembre de 2020 y junio de 2024, consolid\xe1ndose como interlocutor institucional confiable y figura clave en la comunicaci\xf3n de estado.\u202f([turn0search4])\n\u2022 Fue valorado por su capacidad de an\xe1lisis pol\xedtico de coyuntura: alert\xf3 sobre la \u201cpolicrisis\u201d boliviana y previ\xf3 su dificultad para resolverse bajo el gobierno vigente, lo que remarc\xf3 su visi\xf3n estrat\xe9gica.\u202f([turn0search7])\n\u2022 Ha promovido el di\xe1logo y la reconciliaci\xf3n como v\xeda para superar la fractura interna del MAS y fortalecer la gobernabilidad, brindando un aporte reflexivo a la transici\xf3n democr\xe1tica.\u202f([turn0search9])\n\u2022 Se le reconoce por su coherencia intelectual: tras renunciar al cargo p\xfablico emiti\xf3 una carta abierta responsabilizando a sectores por debilitamiento institucional, impulsando reflexiones sobre la democracia y civilidad pol\xedtica.\u202f([turn0search4])\n\u2022 Figur\xf3 como voz moderada dentro del bloque opositor MORENA al ser proclamado candidato a vicepresidente en mayo de 2025, present\xe1ndose como puente entre El Alto, movimientos sociales y estructuras estatales formales.\u202f([turn0search1])\n",A.b(["Cr\xedticas por ambig\xfcedad en crisis internas del MAS","Vinculado indirectamente a estrategias comunicacionales"],q),"\u2022 Fue criticado por afirmar p\xfablicamente que no hay posibilidad de resolver la \u201cpolicrisis\u201d durante el gobierno de Arce, lo que fue interpretado como discurso derrotista y falta de confianza institucional.\n\u2022 Fue cuestionado por referirse a la administraci\xf3n como un \u201cgobierno de jueces\u201d y sugerir que el Tribunal Constitucional sustenta al Ejecutivo, declaraciones que provocaron tensiones con autoridades electorales y judiciales.\n\u2022 Gener\xf3 controversia al acusar a Evo Morales de \u201codio generalizado\u201d y vincularlo con manipulaciones pol\xedticas desde la prensa y parlamento, en declaraciones consideradas polarizadoras y personales.\n\u2022 Fue reprochado por se\xf1alar que la calidad democr\xe1tica de Bolivia atraviesa un momento bajo, insinuando injerencias institucionales que debilitaban al TSE, lo que algunos sectores interpretaron como una visi\xf3n alarmista.\n\u2022 Fue acusado de tergiversar el modelo de poder en el MAS al describir un supuesto triunvirato Evo\u2011Arce\u2011Choquehuanca, lo que gener\xf3 rechazo oficial y fue tildado por dirigentes como distorsi\xf3n de la realidad interna del partido.\n\u2022 Tras renunciar a la vocer\xeda presidencial, fue criticado por revelar que Arce \u201cantepuso su pelea con Evo\u201d a las necesidades del pa\xeds, interpretado como elemento de divisi\xf3n dentro del oficialismo.\n","RED PAT \u2013 entrevista sobre presiones en campa\xf1a  21 de julio de 2025\u2022 Asegur\xf3 que la campa\xf1a de Eva Copa est\xe1 bajo un \u201cfuego cruzado\u201d entre Luis Arce y Evo Morales, se\xf1alando manipulaciones y presiones externas que afectan la candidatura de MORENA.\n\u2022 Explic\xf3 que operadores pol\xedticos del oficialismo y del MAS condicionan la campa\xf1a desde antes de su inscripci\xf3n, generando un entorno adverso y debilitado.\n\nVisi\xf3n\u202f360 \u2013 declaraci\xf3n sobre presiones en candidatura  21 de julio de 2025\u2022 Indic\xf3 que la \xfanica candidata mujer en carrera enfrenta dificultades estructurales por disputas internas de poder entre Arce y Morales, lo que complica la estrategia pol\xedtica de MORENA.\n\u2022 Recalca que las tensiones limitan el desarrollo de la campa\xf1a, present\xe1ndolas como ataques coordinados que buscan impedir su consolidaci\xf3n electoral.\n\nEl Deber Radio \u2013 entrevista sobre posibilidades de retraso electoral  3 de mayo de 2025\u2022 Afirm\xf3 que \u201clas puertas est\xe1n peligrosamente abiertas\u201d a la posibilidad de postergar las elecciones, lo que gener\xf3 alarma sobre manipulaci\xf3n institucional y amenazas a la transparencia del proceso electoral.\n\u2022 Critic\xf3 que el actual gobierno de Luis Arce opera como un \u201cgobierno de jueces\u201d, aludiendo a que el TCP y otros \xf3rganos podr\xedan decidir el curso del proceso.\n\nLa Raz\xf3n \u2013 entrevista sobre refer\xe9ndum y polarizaci\xf3n  28 de agosto de 2024\u2022 Describi\xf3 el refer\xe9ndum propuesto sobre reelecci\xf3n como \u201cprofundamente innecesario\u201d, sugiriendo que busca inhabilitar a Evo Morales y polarizar pol\xedticamente al pa\xeds.\n\u2022 Se\xf1al\xf3 que la propuesta electoral del Gobierno genera divisi\xf3n social en lugar de di\xe1logo, lo cual fue interpretado como cr\xedtica expl\xedcita a la estrategia oficialista.\n\nRed Uno (programa \u201cQue No Me Pierda\u201d) \u2013 debate vicepresidencial 17 de junio de 2025\u2022 Se\xf1al\xf3 que la vicepresidencia \u201cno es un actor altamente protag\xf3nico\u201d, proponiendo transformarla en eje de di\xe1logo nacional; fue criticado por infravalorar el cargo a pesar de presentarse como candidato.\n\u2022 Defini\xf3 la visi\xf3n de Medrano como \u201cmunicipalista\u201d, generando debate sobre su interpretaci\xf3n de la funci\xf3n de vicepresidente como institucionalmente relevante.\n\n",6,14,7,u.r,6,"Jorge Guillermo Richter Ram\xedrez",5,5,7,b,"\u2022 Es polit\xf3logo boliviano con experiencia previa en medios cr\xedticos como \u201cEl Juguete Rabioso\u201d y en el programa \u201cTiempo de Opini\xf3n\u201d, donde desarroll\xf3 su trayectoria como analista pol\xedtico independiente.\u202f\n\u2022 Inici\xf3 su carrera como vocero del excandidato Manfred Reyes Villa bajo el partido NFR, ganando experiencia en comunicaci\xf3n pol\xedtica antes de ingresar al Ejecutivo estatal.\u202f\n\u2022 En diciembre de 2020 fue nombrado vocero presidencial por el presidente Luis Arce Catacora, cargo que ejerci\xf3 hasta junio de 2024, convirti\xe9ndose en interlocutor institucional clave entre el Gobierno y la ciudadan\xeda.\u202f\n\u2022 Durante su gesti\xf3n como vocero comunic\xf3 crisis pol\xedticas como la transici\xf3n post\u20112019 y el rechazo a la reelecci\xf3n de Evo Morales, promoviendo la reconciliaci\xf3n democr\xe1tica y fortalecimiento institucional.\u202f\n\u2022 En junio de 2024 renunci\xf3 de modo p\xfablico y respetuoso, alertando sobre riesgos para el proceso democr\xe1tico e institucional, y elevando su perfil p\xfablico como intelectual cr\xedtico del oficialismo.\u202f\n\u2022 El 20 de mayo de 2025 fue proclamado candidato a la vicepresidencia por el partido MORENA, acompa\xf1ando a Eva Copa dentro del bloque opositor, destacando por su estilo anal\xedtico y postura c\xedvico-pol\xedtica independiente.\u202f\n\u2022 Es considerado una figura de transici\xf3n democr\xe1tica y di\xe1logo plural, con capacidad para tender puentes entre movimientos urbanos como los de El Alto y entidades estatales formales.\u202f\n")
