a=A.dc("Militar retirado, pol\xedtico y empresario boliviano. Fue alcalde de Cochabamba, prefecto del departamento.","Manfred Armando Antonio Reyes Villa Bacigalupi (n. 19 de abril de 1955 en La Paz) es un exmilitar \u2013retirado como capit\xe1n en 1986\u2013, empresario radicado en EE.UU. y pol\xedtico boliviano . Se form\xf3 en el Colegio Militar del Ej\xe9rcito y curs\xf3 estudios en escuelas de las Am\xe9ricas . Tras dejar el ej\xe9rcito, vivi\xf3 en EE.UU., donde fue vicepresidente de Crawford International y CEO de MAREVI Internacional . Regres\xf3 a Bolivia en los a\xf1os 90, fue alcalde de Cochabamba desde 1993 hasta 2000, prefecto electo del departamento de Cochabamba entre 2006 y 2008, y desde mayo de 2021 ejerce nuevamente como alcalde de la ciudad, ganando con 55% de los votos .",p,"Ha demostrado liderazgo sostenido en gesti\xf3n urbana y ejecuci\xf3n de obras p\xfablicas. Su experiencia abarca desde planificaci\xf3n y construcci\xf3n de infraestructura hasta conducci\xf3n de procesos electorales y cooperaci\xf3n internacional como alcalde y prefecto .",A.b(["Impuls\xf3 grandes obras de infraestructura urbana","Promotor de autonom\xeda regional","Regres\xf3 al pa\xeds tras casi 10 a\xf1os de exilio"],q),"Durante su alcald\xeda realiz\xf3 proyectos en v\xedas, puentes, y servicios p\xfablicos; fue reconocido como \u201cmejor alcalde de Bolivia\u201d en 2022-23 . Como prefecto, impuls\xf3 la autonom\xeda de Cochabamba, liderando oposici\xf3n regional frente al gobierno central . Su regreso tras una d\xe9cada en exilio fue interpretado como un acto de reconciliaci\xf3n pol\xedtica y retorno democr\xe1tico .",A.b(["Destituido del cargo de prefecto en 2008","Procesos por presunto da\xf1o econ\xf3mico al Estado"],q),"Fue revocado por referendo en 2008 y enfrent\xf3 m\xe1s de 20 procesos judiciales, incluyendo por construcci\xf3n del Puente R\xedo Sacambaya y otros cargos por malversaci\xf3n . No obstante, el TCP anul\xf3 12 de esos procesos en 2023, lo que su equipo calific\xf3 como parte de persecuci\xf3n pol\xedtica .","",9,15,8,u.b,8,"Manfred Reyes Villa Bacigalupi",6,7,6,a,"Fue alcalde por cuatro periodos (1993\u20132000) bajo ADN y luego Nueva Fuerza Republicana; electo prefecto en 2006 y removido en 2008 tras referendo revocatorio . Se postul\xf3 a la presidencia en 2002 y 2009, quedando como segunda fuerza el segundo intento . Debi\xf3 exiliarse en EE.UU. desde 2009 debido a procesos judiciales por corrupci\xf3n, regresando en 2020; en 2021 fue reelecto como alcalde .")
