a0=A.dc("Funcionario y t\xe9cnico vinculado a la administraci\xf3n local en Cochabamba.","\u2022 Naci\xf3 en Santa Cruz de la Sierra; es concejal municipal por Comunidad Auton\xf3mica (C-A) en Santa Cruz antes de ser designado candidato a vicepresidente.\n\u2022 Empresario y dirigente de base c\xedvica, sin experiencia previa en cargos nacionales, reconocido por su activismo de control y fiscalizaci\xf3n local.\n\u2022 En mayo de 2025 fue presentado oficialmente como candidato a la vicepresidencia acompa\xf1ando a Manfred Reyes Villa para las elecciones generales del 17 de agosto.\n\u2022 Empez\xf3 su carrera pol\xedtica como concejal con fuerte enfoque en transparencia, control ciudadano y lucha contra la corrupci\xf3n desde el \xe1mbito municipal.\n",p,"\u2022 Ha sido identificado como s\xedmbolo de renovaci\xf3n pol\xedtica juvenil por su perfil ciudadano, sin pertenecer a estructuras tradicionales, lo que lo presenta como fuerza nueva.\n\u2022 Se destaca su capacidad fiscalizadora: desde su concejal\xeda mostr\xf3 resultados concretos en transparencia p\xfablica y denuncia de irresponsabilidades municipales.\n\u2022 Medios mencionan su estilo directo y firme: promesas como \u201cmeter presos a todos los p\xedcaros\u201d le dan valor como voz antiimpunidad en el \xe1mbito nacional.\n\u2022 Es visto como operador pol\xedtico capaz de movilizar redes en Santa Cruz y representar al occidente urbano en la f\xf3rmula con Manfred Reyes Villa.\n",A.b(["Promotor de continuidad administrativa","Alineado con el plan de desarrollo urbano"],q),"\u2022 Destacado por su labor como concejal fiscalizador: llev\xf3 a la c\xe1rcel a 22 funcionarios involucrados en corrupci\xf3n en Santa Cruz, seg\xfan cobertura de medios.\n\u2022 Recibi\xf3 elogios por su promesa de combatir la corrupci\xf3n a nivel nacional desde la Asamblea Legislativa, comprometiendo mano dura.\n\u2022 Es el rostro que representa la oposici\xf3n joven y emergente junto a Manfred Reyes Villa, con discurso de cambio y lucha contra impunidad.\n\u2022 Reconocido por su solidaridad con causas sociales y su \xe9nfasis en defender derechos ciudadanos desde redes y acci\xf3n p\xfablica.\n",A.b(["Poca experiencia nacional o legislativa","Perfil bajo en debates p\xfablicos"],q),"\u2022 Fue criticado por declaraciones incendiarias como \u201csacar a patadas\u201d a quienes busquen posponer las elecciones, consideradas amenazas inconstitucionales.\n\u2022 Algunos cuestionan su estilo confrontacional y falta de discurso institucional, percibido como alarmista y poco diplom\xe1tico para la vicepresidencia.\n\u2022 Carece de experiencia legislativa o ejecutiva nacional, lo que genera dudas sobre su capacidad para operar dentro de la Asamblea Legislativa.\n\u2022 Su perfil de fiscalizador combativo fue visto como reactivo m\xe1s que propositivo, con cr\xedticas por priorizar titulares sobre propuestas estructurales duraderas.\n","El D\xeda / presentaci\xf3n candidatura 19 de mayo de 2025\u2022 Afirm\xf3: \u201cQue se cuiden los maleantes, porque vamos a meter presos a todos los p\xedcaros\u201d, generando debate sobre su estilo de discurso y separaci\xf3n de poderes.\n\nLa Raz\xf3n \u2013 advierte suspensi\xf3n de elecciones 12 de julio de 2025\u2022 Advirti\xf3 que quienes busquen postergar las elecciones ser\xe1n \u201csacados a patadas\u201d, lo que fue interpretado como amenaza p\xfablica contra movilizaciones leg\xedtimas.\n\nVisi\xf3n 360 \u2013 declaraci\xf3n sobre presi\xf3n oficialista  21 de julio de 2025\u2022 Denunci\xf3 que su campa\xf1a y la de Eva Copa est\xe1n bajo presiones de actores oficiales (Arce y Morales), presentando una narrativa de cercos y ataques pol\xedticos.\n\n",5,16,8,u.F,4,"Juan Carlos Medrano Gonzales",3,5,4,a0,"\u2022 Fue elegido concejal en Santa Cruz por Comunidad Auton\xf3mica, destacando en fiscalizaci\xf3n del transporte, alimentaci\xf3n y acceso ciudadano a servicios b\xe1sicos.\n\u2022 Goz\xf3 de visibilidad como concejal por criticar malas condiciones sanitarias en locales de comida y exhibir hallazgos p\xfablicamente, ganando notoriedad.\n\u2022 Fue anunciado como compa\xf1ero de f\xf3rmula de Manfred Reyes Villa el 19 de mayo de 2025 por APB\u2011S\xfamate, como representante de una generaci\xf3n nueva y disruptiva.\n\u2022 Asumi\xf3 su candidatura con promesas de mano firme contra la corrupci\xf3n y compromiso con transparencia ciudadana y renovaci\xf3n institucional.\n")
