a1=A.b(["Fundador y presidente de SOBOCE (1987\u20132014)","Ministro de Planeamiento y Coordinaci\xf3n (1991\u20131993)","Presidente del Frente de Unidad Nacional desde 2003","Candidato presidencial en 2005, 2009, 2014 y 2025"],q)
a1=A.dc("Economista, empresario e ingeniero, fundador del Frente de Unidad Nacional (2003).","\u2022 Naci\xf3 el 4 de diciembre de 1958 en La Paz; creci\xf3 entre La Paz y Oruro, donde curs\xf3 estudios escolares y observ\xf3 el golpe en Argentina desde su exilio estudiantil.\n\u2022 Estudi\xf3 Econom\xeda y Administraci\xf3n de Empresas en la Universidad Cat\xf3lica Boliviana, obtuvo maestr\xeda en Arizona State University y doctorado en Econom\xeda (finanzas p\xfablicas) en la London School of Economics.\n\u2022 Empresario multimillonario: fue propietario mayoritario de SOBOCE, present\xf3 \xe9xitos como franquicias nacionales e internacionales (Burger King, Subway, La Quinta) y vendi\xf3 activos por US\u202f300 millones en 2014.\n\u2022 Pol\xedtico de larga trayectoria: exministro de Planeamiento (1991\u20111993), fundador del partido Unidad Nacional (2003), tres veces candidato presidencial (2005, 2009, 2014) y ahora l\xedder de la alianza Unidad para 2025.\n",p,"\u2022 Economista con doctorado y experiencia p\xfablica y privada; medios como AP y El Pa\xeds destacan su condici\xf3n de t\xe9cnico con propuestas macroecon\xf3micas concretas.\n\u2022 Empresario exitoso con experiencia en manejo de crisis y apertura de nuevos mercados; autoridad natural para proponer planes de reactivaci\xf3n econ\xf3mica.\n\u2022 Figura conciliadora dentro del oposicionismo, promueve unidad y di\xe1logo con sectores pol\xedticos diversos, incluyendo con Tuto Quiroga, Camacho y Mesa.\n\u2022 Proyectado por la prensa como l\xedder moderado con foco en eficiencia, meritocracia y profesionalizaci\xf3n del sector p\xfablico.\n",A.b(["Generaci\xf3n de empleo a trav\xe9s del sector empresarial","Promoci\xf3n de responsabilidad social empresarial","Fomento de la democracia multipartidaria"],q),"\u2022 Present\xf3 en octubre de 2024 cinco propuestas concretas para superar la crisis: estabilizar la econom\xeda en 100 d\xedas, promover emprendimientos y frenar bloqueos mediante tolerancia cero.\n\u2022 Propuso medidas como cierre de empresas p\xfablicas ineficientes, eliminaci\xf3n de subsidios petroleros y reducci\xf3n del gasto pol\xedtico, destacadas como urgentes por medios como Los Tiempos y La Raz\xf3n.\n\u2022 Defiende un \u201ccapitalismo con rostro humano\u201d, con \xe9nfasis en mujeres emprendedoras y creaci\xf3n de empleo, tambi\xe9n en generador de inversi\xf3n en litio y sector agropecuario.\n\u2022 En entrevistas internacionales como AP y Infobae, mostr\xf3 postura firme para ordenar relaciones internacionales y rescatar litio, dejando atr\xe1s v\xednculos con China, Ir\xe1n o Rusia.\n",A.b(["Acusado de mantener posiciones neoliberales","Criticado por poder concentrado en el sector cementero"],q),"\u2022 Fue criticado por adoptar un estilo fr\xedo, empresarial y poco emp\xe1tico; en Reddit lo describen como \u201canti-carisma\u201d e incapaz de conectar con el votante promedio.\n\u2022 Cuestionaron su propuesta de eliminar subsidios y cerrar empresas estatales sin explicar mitigaciones sociales, tach\xe1ndolas de promesas populistas sin base t\xe9cnica.\n\u2022 Hubo cr\xedticas sobre su origen econ\xf3mico como empresario multimillonario, sugerencias en redes de que su riqueza provino de la privatizaci\xf3n de empresas estatales mientras era funcionario.\n\u2022 Fue acusado de ambiguo ideol\xf3gicamente: en redes usuarios lo consideraron el \u201cpresidente ideal para los ricos\u201d, mientras critic\xf3 la Internacional Socialista pero sigue vinculado a ella.\n","Unitel \u2013 As\xed Decidimos (Entrevista) 19 de mayo de 2025\u2022 Explic\xf3 su plan de gobierno basado en una recuperaci\xf3n econ\xf3mica en 100 d\xedas, lo que gener\xf3 cr\xedticas por promesas simplistas y falta de detalle t\xe9cnico en temas fiscales.\n\u2022 Respondi\xf3 sobre c\xf3mo enfrentar\xeda la escasez de combustible y d\xf3lares se\xf1alando al Gobierno, lo que fue interpretado como discurso populista sin soluciones concretas.\n\nEl Deber Radio \u2013 Entrevista econ\xf3mica y unidad 22 de marzo de 2025\u2022 Se\xf1al\xf3 que el desabastecimiento de carburantes pudo ser promovido por el Gobierno para presionar al Legislativo, acusaci\xf3n que algunos consideraron conspirativa e infundada.\n\u2022 Indic\xf3 que se respetar\xe1n encuestas internas del bloque de unidad, aunque sectores cr\xedticos lo interpretaron como ambig\xfcedad estrat\xe9gica frente a posibles divisiones opositoras.\n\nUPB \u2013 Foro \u201cSin filtros\u201d 20 de marzo de 2025\u2022 Afirm\xf3 que Bolivia necesita dejar el \u201csocialismo del siglo XXI\u201d de Evo Morales por un \u201ccapitalismo con rostro humano\u201d, lo que gener\xf3 debate sobre una reforma liberal poco contextualizada.\n\u2022 Prometi\xf3 facilitar un mill\xf3n de emprendimientos en cinco a\xf1os, lo que fue cuestionado por su viabilidad real ante una econom\xeda formal d\xe9bil.\n\nANF / As\xed opin\xf3 \u2013 Debate con Chi Hyun Chung 8 de febrero de 2025\u2022 Afirm\xf3 que, de ganar Chi, \u201cBolivia terminar\xeda como Hait\xed, en hambruna, en llamas\u201d, lenguaje que fue considerado alarmista y polarizador por distintos analistas.\n\nVisi\xf3n 360 / Entrevistas en el exterior 27 de julio de 2025\u2022 Declar\xf3 que el MAS est\xe1 en una \u201ccrisis terminal\u201d y que terminar\xe1 su ciclo pol\xedtico, lo que fue interpretado como narrativa triunfalista que puede cerrar el di\xe1logo pol\xedtico.\n\u2022 Critic\xf3 severamente al expresidente Evo Morales y al actual gobierno por incompetencia financiera, sin ofrecer evidencia detallada, lo que suscit\xf3 cuestionamientos de exageraci\xf3n pol\xedtica.\n\nDebate presidencial \u2013 UNITEL / Plan contra inflaci\xf3n 20 de julio de 2025\u2022 Present\xf3 un plan de inflaci\xf3n con tres medidas, empezando por \u201cno gastar m\xe1s de lo que tenemos\u201d, propuesta valorada por claridad pero vista como insuficiente ante la complejidad fiscal.\n\u2022 Propuso eliminar presupuesto pol\xedtico y despilfarro estatal, lo que fue recibido como discurso populista aunque con cierto respaldo por sectores cr\xedticos del Estado.\n\n",8,17,9,u.q,6,"Samuel Jorge Doria Medina Auza",6,8,5,a1,"\u2022 Desde joven, miembro del MIR; fue analista en UDAPE y funcionario clave en Ministerio de Finanzas antes de llegar a ministro de Planeamiento y Jefe de Gabinete Econ\xf3mico (1992\u20111993).\n\u2022 En 2005 fund\xf3 Unidad Nacional; compiti\xf3 por la presidencia en 2005, 2009 y 2014. En 2014 renunci\xf3 y apoy\xf3 la unidad opositora, vendiendo sus empresas para dedicarse a la pol\xedtica.\n\u2022 Reconocido como industrial latinoamericano por AILA en 2012; maneja inversiones en cemento, alimentaci\xf3n y hoteler\xeda.\n\u2022 Fue designado en abril de 2025 como candidato presidencial por el bloque Unidad, liderando una opci\xf3n de centro-derecha liberal moderada.\n")
