a2=A.b(["Ministro en los gobiernos de Jaime Paz, Hugo Banzer y Jorge Quiroga","Director del Instituto Nacional de Estad\xedstica (INE, 1991)","Gerente del BID para pa\xedses del Cono Sur y director en la CAF"],q)
a2=A.dc("Economista con amplio perfil t\xe9cnico. Ha sido ministro en varios gobiernos.","\u2022 Naci\xf3 el 23 de agosto de 1961 en Vallegrande, Santa Cruz; economista graduado de la Universidad Aut\xf3noma de M\xe9xico y con maestr\xeda en Econom\xeda Internacional, Moneda y Banca en la Universidad de Colorado.\n\u2022 Tiene estudios de doctorado en Producci\xf3n y Operaci\xf3n Gerencial por la Universidad de Colorado (EE.UU.) y tambi\xe9n fue docente universitario en Bolivia.\n\u2022 Ha ocupado cinco ministerios en Bolivia (Econom\xeda, Gobierno, Presidencia, Desarrollo Econ\xf3mico e Informaciones) y fue director del INE en 1991, donde organiz\xf3 el primer censo en 16 a\xf1os.\n\u2022 Desempe\xf1\xf3 altos cargos en organismos internacionales como gerente del BID para el Cono Sur, representante en Argentina, Brasil y Colombia y gerente de estrategias corporativas en la CAF.\n\u2022 Fue anunciado como candidato a la vicepresidencia el 14 de mayo de 2025 por la alianza Unidad, acompa\xf1ando a Samuel Doria Medina.\u202f\n",p,"\u2022 Es considerado un t\xe9cnico con vasta experiencia en manejo del Estado y organismos internacionales, ideal para enfrentar crisis econ\xf3micas, seg\xfan analistas como Gustavo Pedraza\u202f\n\u2022 Medios como EFE y Red Uno destacan su conocimiento para atraer inversi\xf3n extranjera y fortalecer la diplomacia econ\xf3mica.\n\u2022 Posee capacidad de di\xe1logo y construcci\xf3n de consenso pol\xedtico, lo que le permite articular acuerdos legislativos con m\xfaltiples corrientes partidarias.\n\u2022 Es percibido como un candidato con perfil t\xe9cnico, profesional y con respaldo institucional, en contraste con dicursivas m\xe1s populistas.\n",A.b(["Experticia en financiamiento y desarrollo econ\xf3mico","Dise\xf1o y ejecuci\xf3n de proyectos regionales","Visi\xf3n t\xe9cnica para pol\xedtica macroecon\xf3mica"],q),"\u2022 Ha sido elogiado por presentar una agenda legislativa anticrisis con propuestas como la Ley Financial 2026 y nuevas reformas fiscales para estabilizar la econom\xeda.\n\u2022 Medios se\xf1alan su capacidad para gestionar inversiones internacionales y reactivar el crecimiento econ\xf3mico mediante alianzas globales.\n\u2022 Se valora su trayectoria impecable en organismos internacionales, visi\xf3n profesional y acercamiento prudente y diplom\xe1tico en alianzas pol\xedticas.\n\u2022 Reconocido por aportar un perfil distinto al discurso pol\xedtico nacional, basado en madurez t\xe9cnica y di\xe1logo institucional.\n",A.b(["Cr\xedticas por tecnocracia sin enfoque pol\xedtico","Ausencia de liderazgo visible en campa\xf1as p\xfablicas"],q),"\u2022 Fue cuestionado por su perfil excesivamente t\xe9cnico y distante, descrito como \u201canti\u2011carisma\u201d, lo que le dificulta conectar con votantes de base.\n\u2022 Cr\xedticas sobre su gesti\xf3n en el INE y ministerios incluyen acusaciones de enfoque elitista y desconexi\xf3n con poblaciones vulnerables.\n\u2022 Fue advertido que su agenda anticrisis, como la eliminaci\xf3n de subsidios o cierre de empresas p\xfablicas, carece de enfoque social o planes compensatorios claros.\n\u2022 Algunos sectores lo consideran parte de la \xe9lite econ\xf3mica tradicional, lo que le resta legitimidad frente a votantes que buscan renovaci\xf3n ciudadana.\n","Unitel \u2013 As\xed Decidimos (panel vicepresidencial) 16 de junio de 2025\u2022 Propuso una Ley Financial 2026 como eje anticrisis y exigi\xf3 elecci\xf3n del TSE, lo que fue criticado por presentarse como norma t\xe9cnica sin consulta social amplia.\n\neju.tv \u2013 \u201cBolivia no tiene tiempo\u201d 17 de junio de 2025\u2022 Afirm\xf3 que Bolivia requiere una sola agenda legislativa anticrisis porque \u201cest\xe1 cayendo en una velocidad extrema\u201d; sus declaraciones fueron consideradas alarmistas y dictadas por urgencias electorales.\n\nNoticiero Unitel \u2013 Presentaci\xf3n candidatura 14 de mayo de 2025\u2022 Samuel Doria Medina afirm\xf3 que Lupo es la persona con experiencia para salir de siete crisis econ\xf3micas; aunque valorado, algunos cuestionaron la dependencia de Doria Medina en asesor\xedas externas.\n\nPeriodista El Deber \u2013 entrevista lanzamiento 14 de mayo de 2025\u2022 Doria Medina describi\xf3 a Lupo como figura de di\xe1logo con todos los partidos, sin embargo, medios se\xf1alaron ambig\xfcedad respecto a pacto con partidos alternativos al MAS.\n\n",9,18,9,"assets/postulantes/UNIDAD_Jose_Lupo.jpg",4,"Jos\xe9 Luis Lupo Flores",3,8,4,a2,"\u2022 Desde principios de los 90 fue asesor t\xe9cnico en el INE, ministro de Hacienda, Desarrollo Econ\xf3mico y presidencia, durante los gobiernos de Paz Zamora, Banzer y Quiroga.\n\u2022 Durante su etapa en organismos multilaterales como BID y CAF (1994\u20112021), gestion\xf3 proyectos de desarrollo regional y crisis econ\xf3micas en varios pa\xedses sudamericanos.\n\u2022 Fund\xf3 su carrera pol\xedtica en Unidad Nacional y continu\xf3 como figura t\xe9cnica prominente, sin disputar elecciones presidenciales pero ganando reconocimiento institucional.\n\u2022 Fue proclamado candidato a la vicepresidencia el 14 de mayo de 2025 como parte del bloque Unidad, para aportar experiencia t\xe9cnica al proyecto opositor.\n")
